            RuyaSembol(sembolResim: "", sembolisim: "Diz", sembolAnlami: "Direnci simgeler. Bazen direnç göstermeyi bazen de saygı duymayı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Dizler", sembolAnlami: "Diz rahatsızlıkları, kişinin direnç gösterdikleri ya da göstermedikleri ile ilgilidir. Kişi direnç göstermez ve saygı duyar. Bazen de kişinin mecazi olarak diz çökmesi ya da kuvvet alıp kalkması ile ilgilidir."),
            RuyaSembol(sembolResim: "", sembolisim: "Doğal Taş", sembolAnlami: "Taşın anlamına göre yorumlanır."),
            RuyaSembol(sembolResim: "", sembolisim: "Doğum Günü", sembolAnlami: "Kişinin yeni keşfettiği potansiyelini Rüya: simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Doğum Haritası", sembolAnlami: "Yeni bir başlangıcın yakın olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Doğum Yapmak", sembolAnlami: "Yeni bir başlangıç yapmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Doktor", sembolAnlami: "Şifacılığı simgeler. Görülen doktorun branşı şifa hakkında fikir verir."),
            RuyaSembol(sembolResim: "", sembolisim: "Dolandırıcı", sembolAnlami: "Kişinin kendini aldattığı ve akıllıca davranmadığı durumları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Dolap", sembolAnlami: "Kişinin hallerindeki zenginliği simgeler. Her bir elbise kişinin içinde bulunduğu bir hali ve diğer insanlara karşı takındığı bir yönünü ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Dolunay", sembolAnlami: "Anneliğin tam olarak yapılabildiği durumları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Domuz", sembolAnlami: "Haramı simgeler. Maddi, manevi haksız ve ahlaksız kazancı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Dosya", sembolAnlami: "Eski hesapları ya da kapanmamış eski hesapları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Dövmek", sembolAnlami: "Bkz. Dayak"),
            RuyaSembol(sembolResim: "", sembolisim: "Drone", sembolAnlami: "Kişinin, başkaları tarafından gizlice gözetlendiğini, simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Dua", sembolAnlami: "Manevi talepleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Duman", sembolAnlami: "Düşünceli olma halini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Durak", sembolAnlami: "Kişinin hayatta nefes aldığı ya da beklemeye geçtiği dönemleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Dut", sembolAnlami: "Daha az ve öz konuşmayı, ya da konuşulması gerektiğini, simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Duvar", sembolAnlami: "Düşünce kalıplarını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Düğüm", sembolAnlami: "Kişinin kendisini veya başkasını zora soktuğu durumları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Düğün", sembolAnlami: "Evlilik, ortaklık ve sevindirici gelişmeleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Dükkan", sembolAnlami: "Direk maddi kazançları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Dünya", sembolAnlami: "Madde alemi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Dünya Dışı", sembolAnlami: "Madde dışı alemi ve diğer alemleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Dürbün", sembolAnlami: "İleriyi görebilmeyi ve öngörüyü simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Düşmek", sembolAnlami: "Bir işi başaramamayı, yapamamayı ve frekansın düşmesini simgeler."),
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Ebe", sembolAnlami: "Aile dışı kurulan yakın ilişkileri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Ehliyet", sembolAnlami: "Hayatının sorumluluğunu alabilecek beceriye sahip olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Ejderha", sembolAnlami: "Kişinin içindeki gücünü simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Ekin", sembolAnlami: "Emeği simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Ekmek", sembolAnlami: "Rızkı simgeler. Babadan gelen rızkı da simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "El", sembolAnlami: "Şifayı simgeler. Bazen de kişinin aldıklarını ve verdiklerini ifade eder. Bazen de bir işi yapmaya başlamayı temsil eder."),
            RuyaSembol(sembolResim: "", sembolisim: "El İçi (Avuç İçi)", sembolAnlami: "Şifayı simgeler. Avuç içi kişinin imzası gibidir. Kişi kendi eli ile ne yapıyorsa onun yansımalarını kendi hayatında görecektir. Helale dikkat ederek yaşayan insanın eli şifalıdır. Çünkü elin içerisinde bakteriler vardır ve kişinin yaşam tarzı o bakterileri etkiler. Bundan dolayı bazı kişilerin elinden çıkan yemekler, dikilen kıyafetler vs. diğer insanlara hayırlı ve iyi gelirken bazılarının ki iyi gelmez."),
            RuyaSembol(sembolResim: "", sembolisim: "El Öpmek", sembolAnlami: "Rıza almayı simgeler. O kişinin onayını ve müsadesini almayı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "El Sıkışmak", sembolAnlami: "Anlaşmayı ve uzlaşmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Elbise", sembolAnlami: "Kişinin o an içinde bulunduğu ve diğer insanlara karşı takındığı durumu, hali simgeler. Her elbise kişinin bir halini ve yönünü anlatır. Kıyafetin rengi de için de bulunduğu duygu durumu hakkında bilgi verir. Dikkat! Eski elbise, kendini yenileyemediğini anlatır. Yırtık ise kişinin kendini gözden geçirmesi gerekir. Fakat o anda yırtıldıysa kişi o anda yaptığı işi sorgulamalı. Ama yaşlı bir insanı eski veya yırtık kıyafetler içerisinde görmek kişinin halleri değildir. Bu kişi mübarek bir zat olabilir ya da kişinin ataları olabilir. Ayrıca bazen yırtık pırtık kıyafet içindeki hazineyi keşfedememeyi de anlatabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Elçi", sembolAnlami: "Aracıyı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Elma", sembolAnlami: "Yeni hayat formunu simgeler. Isırılmış elma, yasaklanan yaşam formunu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Elma Ağacı", sembolAnlami: "Yeni yaşam genini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Elma Çiçeği", sembolAnlami: "Frekansı ve enerji değişimini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Elmas", sembolAnlami: "Kişinin en yüksek idrak noktasında olduğu hali simgeler. Bu kişi,ne yaparsa yapsın çevresindeki insanlar tarafından her zaman kabul görür."),
            RuyaSembol(sembolResim: "", sembolisim: "Emzirme", sembolAnlami: "Beslemeyi simgeler. Beslenen bir düşünceyi veya durumu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Engelli", sembolAnlami: "Kişinin engellediği ve kullanamadığı yönünü simgeler. Rüyada kişi engeli nerede görüyorsa kendisinde kullanamadığı yönü orasıdır."),
            RuyaSembol(sembolResim: "", sembolisim: "Enstürman Çalmak", sembolAnlami: "Bkz. Çalgı Çalmak"),
            RuyaSembol(sembolResim: "", sembolisim: "Erkek (Eril-Oğlan)", sembolAnlami: "Gücü simgeler. Rüyada görülen Rüya: her erkek için geçerlidir."),
            RuyaSembol(sembolResim: "", sembolisim: "Eski Ev", sembolAnlami: "Ata evini veya yenilenmeyi simgeler. Kişi halen oturduğu evi eski görüyorsa kendisini yenilemesi gerekir. Fakat hiç tanımadığı eski bir eve veya köy evine gittiğini görüyorsa; ata evine gitmiş demektir."),
            RuyaSembol(sembolResim: "", sembolisim: "Eski Sevgili", sembolAnlami: "O ilişkide neler yaşandığına bakılması gerekiyor."),
            RuyaSembol(sembolResim: "", sembolisim: "Eski Şeyler", sembolAnlami: "Kişi eski olarak neyi görüyorsa onun sembol değerine göre yorum yapması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Eskici", sembolAnlami: "Kişi eskiciye neyi verdiğini görüyorsa onun sembol değerine göre yorum yapması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Esnemek", sembolAnlami: "Çözülmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Eş", sembolAnlami: "Kadın için eşi, eril halini; erkek için eşi, dişil halini simgeler. Kadının eşi, babası ile ilgili bilinçaltı kayıtlarını ve kişinin gücünü ifade eder. Erkeğin eşi, annesi ile ilgili bilinçaltı kayıtlarını ve kişinin üretkenliğini temsil eder. Eğer olumsuz olan bilinçaltı kayıtları şifalanırsa kişi rüyasında eşini başka biri olarak hem de daha iyi bir surette görebilir. Kişide gerçekleşen iyileşme normal hayatta eşine de yansır. Bundan dolayı eş ile ilgili problemlerde önce ebeveynle ilgili hangi olumsuz bilinçaltı kaydı var ise rüyada sorulmalı ve şifalandırma çalışması yapılmalıdır."),
            RuyaSembol(sembolResim: "", sembolisim: "Eşek", sembolAnlami: "Fedakarlığı simgeler. Bilinçli olarak başkalarına ait sorumlulukları almayı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Eşik", sembolAnlami: "Ani geçiş yerini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Eşinin Ailesi", sembolAnlami: "Kişinin kendi ailesi gibi değerlendirilir. Fakat burada kişinin gücü önemlidir."),
            RuyaSembol(sembolResim: "", sembolisim: "Eşkiya", sembolAnlami: "Zorbalığı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Eşortman", sembolAnlami: "Kişinin rahat davrandığını ya da rahat olunması gerektiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Eşya", sembolAnlami: "Kullanım amacına göre değerlendirilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Et", sembolAnlami: "Bkz.Çiğ Et"),
            RuyaSembol(sembolResim: "", sembolisim: "Etiket", sembolAnlami: "Sosyal statüyü simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Ev", sembolAnlami: "İnsanın kendisini simgeler. Birçok ev görmek kollektifi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Antresi", sembolAnlami: "Arada kalmayı ve karar verememeyi simgeler. Geçiş yerlerini de ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Avlusu", sembolAnlami: "Kişinin aurasının kapalı olduğunu ifade eder. Diğer insanlarla iletişimi zayıftır."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Bahçesi", sembolAnlami: "Aurayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Balkonu", sembolAnlami: "Sosyallikteki etkileşimi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Banyosu", sembolAnlami: "Arınmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Bodrumu (Mahsen)", sembolAnlami: "Arınmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Boş Odaları", sembolAnlami: "Kullanılmayan potansiyelleri simgeler. Rüyada yeni fark edilen boş odalar, kişinin farkında olmadığı potansiyelleri olduğunu ifade eder. Mesela kişi iyi bir aşçıdır fakat bu yeteneğini daha keşfetmemiş olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Camları", sembolAnlami: "Bakış açılarını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Çatısı", sembolAnlami: "Çatının en üstüne çıkmak, akılcı işler yapmamayı, kontrolsüzlüğü simgeler. Mantık sınırlarının dışına çıkmayı ifade eder. Bazen de anneyi, koruyuculuğu ve güveni temsil eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Çocuk Odası", sembolAnlami: "Kişinin çocukluk kayıtlarını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Dağınık Olması", sembolAnlami: "Hayatını düzene sokamadığını düşünmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Ebeveyn Odası", sembolAnlami: "Ata kayıtlarını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin İçine Girmek", sembolAnlami: "Kabul etmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Kapısı", sembolAnlami: "Güvenliği simgeler. Bazen de başka bir boyuta geçmeyi ifade eder. Mesela kişi fakirken zengin olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Kileri", sembolAnlami: "Birikimleri ve kazanımları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Kolunu", sembolAnlami: "Babayı ya da kişiyi ayakta tutan Rüya: şeyleri, simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Misafir Odası (Salon)", sembolAnlami: "Yakın sosyal ilişkileri ve sosyalliği simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Mutfağı", sembolAnlami: "Çalışma ve rızık alanını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Müstakil Olması", sembolAnlami: "Şahsına münhasır, kendine özgü insanları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Şömine (Evin Sobası)", sembolAnlami: "Kişinin kalbini simgeler"),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Tahtadan Olması", sembolAnlami: "Kişinin genetik kodlarını ve aktarımlarını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Terası", sembolAnlami: "Frekans yüksekliğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Tuvaleti", sembolAnlami: "Kişinin tutunduğu veya bıraktığı şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Yanması", sembolAnlami: "Bkz.Evin Yıkılması."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Yatak Odası", sembolAnlami: "Kişinin özel alanını ve kök çakrayı simgeler. Vicdani duyguları, iç hesaplaşmaları da ifade eder.Eğer yastık ile beraber görülürse iç hesaplaşmalara, gizli düşüncelere bakılmalı. Yorgan ile beraber görülürse kişinin özel hayatındaki savunmasızlığına, yalnızlık duygusuna bakılmalı, çarşaf veya yatak ile beraber görülürse kök çakra ile ilgili konulara bakılmalıdır."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Yıkılması", sembolAnlami: "Köklü değişimi simgeler. Bu rüyayı gören kişi değişimin hayırlı, kolay ve hızlı olması için sadaka verip dua etmelidir."),
            RuyaSembol(sembolResim: "", sembolisim: "Evin Yüksekliği", sembolAnlami: "Frekans yüksekliğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evlenmek", sembolAnlami: "Ortaklığı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evliya", sembolAnlami: "Allah dostlarını, ruhani varlıkları ve ruhsal rehberleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Evrak", sembolAnlami: "Kayda geçirilmesi gereken şeyler olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Ezan Sesi Duymak", sembolAnlami: "Maneviyata çağrı yapmayı simgeler."),
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Fabrika", sembolAnlami: "Kişinin üretkenliğini ve üretim kapasitesini simgeler. Mesela bir öğretmen fabrika görse o fabrikadan mezun olmuş çocuklar çıkar."),
            RuyaSembol(sembolResim: "", sembolisim: "Fal", sembolAnlami: "Ehil olmayan kişilerden öngörü almayı simgeler. Arada kalınan ve karar verilemeyen dönemleri ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Falaka", sembolAnlami: "Yardım almayı simgeler. Hayatta atılan adımlarda destek görmeyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Falcı", sembolAnlami: "Bkz.Fal"),
            RuyaSembol(sembolResim: "", sembolisim: "Fare", sembolAnlami: "Kaygıları ve kuşkuyu simgeler. Kişiyi kemiren negatif düşünceleri ve vesveseleri ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Fare Deliği", sembolAnlami: "Hayatta yaratılan açıkları simgeler. Mesela kötü bir insana yüz vermek,fare deliği açmayı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Farklı Rüyalarda Hep Aynı Yeri Görmek", sembolAnlami: "Kişi farklı rüyalarında hep aynı yeri görüyorsa orada takılıp kaldığı bir şeyler vardır."),
            RuyaSembol(sembolResim: "", sembolisim: "Fatura", sembolAnlami: "Ödenmesi gereken bedeller olduğunu simgeler. Kişinin yaptıkları ya da yapacakları ile ilgili olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Felçli Birini Görmke", sembolAnlami: "Hareket edememeyi simgeler. Felçli olarak kim görülüyorsa onun özelliğine dikkat edilmesi gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Fener", sembolAnlami: "Yol gösterici şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Fındık", sembolAnlami: "Kendine güveni simgeler. Burunu Rüya: temsil eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Fırtına", sembolAnlami: "Başkalarından kaynaklı yada herkesi etkileyen, çok müdahale edilemeyen dönemleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Fidan", sembolAnlami: "Çocukluk ve gençlik dönemini Rüya: simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Fil", sembolAnlami: "Yeniliklere açık olmamayı ve eskiye bağlı hareket etmeyi, unutamamayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Fotoğraf", sembolAnlami: "Kişinin yaşadığı şeylerde hangi anları önemli kıldığını simgeler. Kişi neyin resmini çektiğini görüyorsa ona dikkat etmesi gerekir. Çünkü yaşadığı o ana önem veriyordur. Fotoğrafçı ise kişinin hangi bakış açısıyla o anı kayda aldığını anlatır. Fotoğrafçı olarak görülen kişinin özelliğine dikkat edilmesi gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Fotoğrafçı", sembolAnlami: "Bkz. Fotoğraf"),
            RuyaSembol(sembolResim: "", sembolisim: "Fujya Renk", sembolAnlami: "Kırmızı ve pembe karışımı olduğu Rüya: için kök çakra ile ilgili hayalleri Yorum: simgeler."),
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Gaflete Düşmek", sembolAnlami: "Yanlışa düşmeyi simgeler. Kişinin Rüya: fark edemediği, göremediği şeyler Yorum: olduğunu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Galibiyet", sembolAnlami: "Bir olayın veya durumun mutlu sonuçlanmasını simgeler. Kişinin nede galip geldiği dikkate alınarak yorum yapılmalıdır."),
            RuyaSembol(sembolResim: "", sembolisim: "Gam", sembolAnlami: "Kişinin gam ve kederli halinden kurtulmasını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Gamze", sembolAnlami: "Kişinin pozitif olduğu zaman ortaya çıkacağı özellikleri olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Ganimet", sembolAnlami: "Hiç ummadık yerden gelen ve maddi değeri olan şeyleri simgeler. Para, mal veya mülkü ifade eder. Fakat beklentin olmadan sana geldiği için bu şeylerin bir kısmının dağıtılması uygun olur. Mesela şans oyunlarından gelen paralar gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Gar (Tren Garı)", sembolAnlami: "Geçmiş ile bağlantıyı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Garah", sembolAnlami: "Kullandığın yöntemi sağlama almayı simgeler. Araba ne kadar çoksa garajda, kişinin o kadar yöntemi vardır. A, B planı gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Gardiyan", sembolAnlami: "Kişinin olumsuz düşünce kalıplarını destekleyen insanları simgeler. Bazen kişilerin korkularını da ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Gardrop", sembolAnlami: "Bkz.Dolap"),
            RuyaSembol(sembolResim: "", sembolisim: "Garnizon", sembolAnlami: "Koruyucu güçleri (kişinin aklı, aldığı dua, manevi rehberler vs.) simgeler. Kişinin güçlü bir koruma altında olduğunu ifade eder. Fakat ordunun kimlerden oluştuğu önemlidir. Kişi kötü şeylerden koruma bekliyor ya da onlara hizmet ediyor olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Garson", sembolAnlami: "Kişinin beslendiği şeye hizmet eden insanları simgeler. Mesela kişinin arkadaşının bilgisinden faydalanması ve arkadaşının ona hizmet etmesi gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Gasp Edilmek", sembolAnlami: "Başkasının hakkına girmeyi simgeler. Neyin gasp edildiğine dikkat edilmesi gerekir. Bu rüyayı gören kişi kendini sorgulamalı ve hak sahibine hakkını vermelidir.Ayrıca sadaka vermesi de uygundur."),
            RuyaSembol(sembolResim: "", sembolisim: "Gayret Etmek", sembolAnlami: "Gayret edilmesi gerektiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Gazete", sembolAnlami: "Kişinin hayatında haber değeri taşıyan önemli olayları simgeler. Özellikle tarih varsa bu tarih birebir doğru çıkabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Gazino", sembolAnlami: "Dünyanın gösteriş ve şatafatına dalmayı simgeler. Rüyayı gören kişinerede eğlenceye ve dünyanın şatafatlı haline kapıldım diye kendisini sorgulaması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Gebelik", sembolAnlami: "Kişinin değişim sürecine girdiğini ve bunu fark etmesi gerektiğini simgeler. Yeniden doğuşu ifade eder. Kişi kaç aylık hamile ise değişim o kadar zaman önce başlamıştır. Fakat kişi farkında değildir. Doğuma ne kadar zamanı kaldı ise o kadar süre sonra hayatında yeni bir başlangıç olacaktır."),
            RuyaSembol(sembolResim: "", sembolisim: "Gece", sembolAnlami: "Hüznü ve karamsarlığı simgeler. Ayrıca kişinin uyanış arefesinde olduğunu da ifade eder. Gecenin ortasında ise kişinin maneviyatına yönelmesi ve dua etmesi gerekir. Gecenin en zifiri karanlığında ise, kişinin aydınlığa çıkması yakındır. Gece ama ufuktaki çizgi görünüyor ise, yeni bir dönem kişi için başlıyor demektir."),
            RuyaSembol(sembolResim: "", sembolisim: "Geçit", sembolAnlami: "Hedefe giden ve yolu kısaltan yöntemlerin olduğunu simgeler. Kişi aklını kullanmalı ve daha gözü açık olmalıdır."),
            RuyaSembol(sembolResim: "", sembolisim: "Gelin Çiçeği", sembolAnlami: "Kısmetin açılmasını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Gelinlik", sembolAnlami: "Arzu edilen şeye kavuşmayı simgeler. Gelinliği kim giyiyorsa o kişinin arzusuna bakılmalıdır. Rüyayı gören kişi için o arzu gerçekleşecektir."),
            RuyaSembol(sembolResim: "", sembolisim: "Gemi", sembolAnlami: "Muhafaza edilmeyi, güvende olmayı ve korunarak gitmeyi simgeler. Bazen gizlenen ilimleri de ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Geminin Sirenini Duymak", sembolAnlami: "Maneviyata çağrı yapmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "General", sembolAnlami: "Toplumu yöneterek yön vermeyi ve saygınlık, itibar kazanmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Gergedan", sembolAnlami: "Soydan gelen gücü ve eril gücü simgeler. Siyasi bir güç, cinsel bir güç ya da kişinin genlerinde taşıdığı bir güç gibi olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Geyik", sembolAnlami: "Kişiye güç verecek hediyeleri simgeler. Bu Allah'tan gelen hediyelerde olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Gezegen", sembolAnlami: "Kişinin özelliklerinden bahseder. Her gezegen kişinin farklı bir yanını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Girdaba Kendini Bırakmak", sembolAnlami: "Teslim olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Gişe", sembolAnlami: "Hak kazanmak için uğraşmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Gizlenmek", sembolAnlami: "Kişinin gizlemeye çalıştığı halini simgeler. Kimi gizlenmiş görüyorsa, kendindeki o hali diğer insanlardan gizlemeye çalışıyordur."),
            RuyaSembol(sembolResim: "", sembolisim: "Gonca", sembolAnlami: "Duyguların canlanmasını simgeler. Kişi hangi çiçeğin tomurcuğunu görüyorsa o duygusunun canlanacağını anlayabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Göbek", sembolAnlami: "Manevi bağ ile kurulan ilişkileri simgeler. Gönülden bağlı olan herkesi ifade eder. Özellikle kişinin çocuklarını da temsil eder. Bu rüyayı gören kişinin belki de bağlı olmaması gerekiyordur."),
            RuyaSembol(sembolResim: "", sembolisim: "Göç Etmek", sembolAnlami: "Köklü değişimi simgeler. Gerçek hayatta kişinin büyük değişiklikler yaşayacağına işaret eder. Göç edilen yere bakılarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Göğe Çıkmak", sembolAnlami: "Maneviyatta yükselmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Göğüs", sembolAnlami: "Bir şeyi beslemeyi ve yeniden bir oluşumu simgeler. Kişinin kendisini yeniden büyütmesini ifade eder. Fakat iki göğsün arası kişinin inancını temsil eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Gök Gürültüsü", sembolAnlami: "Toplumsal olayları simgeler. Topluluk için geçici ama zor bir dönemi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Gökdelen", sembolAnlami: "Gökdelenin içinde görülen ev frekansı simgeler. Evin bulunduğu kat dikkate alınarak kişinin frekansı hakkında değerlendirme yapılır. Ayrıca ev, gökdelenin en yukarı katında ise kişinin yükseleceğini ifade eder. Fakat gökdeleni karşıdan görmek kişinin birilerini örnek alarak yükselmesi gerektiğini anlatır."),
            RuyaSembol(sembolResim: "", sembolisim: "Gökkuşağı", sembolAnlami: "Cinsiyeti simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Gökyüzü", sembolAnlami: "İlimi, mertebeyi ve yüksek frekansı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Göl", sembolAnlami: "Sırları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Gölge", sembolAnlami: "Kişinin karanlık yanlarını simgeler. Kişinin tamamen negatif, bilinmeyen veya bastırmaya çalıştığı negatif yanları ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Gölge", sembolAnlami: "Kişinin gölge yanlarını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Gömlek", sembolAnlami: "Bkz.Ceket"),
            RuyaSembol(sembolResim: "", sembolisim: "Gömmek", sembolAnlami: "Kişinin kurtulmak istediği ve bir daha görmek istemediği şeyleri simgeler. Kişi bir şeyi gömdüğünü görüyorsa ona gömdüğü şey ile ilgili kazı yapılması gerekir. Çünkü kendisi gömdüğü şeyi unutmuştur ama bu bedenindedir ve onunla hareket ediyordur. Bundan dolayı o kişi ile konuşulmalıdır. Mesela rüyada kıskanç birini gömdüğünü gören kişi kıskançtır ama bunu zihin seviyesinde kabul etmez. O yüzden bu kişiye sen bu hareketi neden yaptın diyerek, o kıskanç halini ortaya çıkarmak gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Görünmez Olduğunu Görmek", sembolAnlami: "Olaylardan ve durumlardan sezgisel olarak haberdar olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Gösteriş", sembolAnlami: "Başkalarını etkilemek, kendini beğendirmek ya da böbürlenmek amacıyla yapılan şeyleri, simgeler. Yapılan şeyin gösteriş için yapıldığını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Göz", sembolAnlami: "Mecazi anlamda görmek istemeyi veya görmek istememeyi simgeler. Ayrıca nazar gibi görülemeyen enerjileri de ifade eder. Mesela kötü bir göz görmek, kötü bir etki olduğunu, kişinin bunu fark etmediğini ve görmesi gerektiğini anlatır."),
            RuyaSembol(sembolResim: "", sembolisim: "Göz Kalemi", sembolAnlami: "Özellikle görülmesi gereken şeyler olduğunu simgeler. Sürme çekiliyorsa o şeyin altı çiziliyor demektir."),
            RuyaSembol(sembolResim: "", sembolisim: "Göz Kırpmak", sembolAnlami: "Kişinin gördüğü ama fark etmediği şeyleri simgeler. Bazı şeylerin farkında olunması gerektiğini, orada önemli şeyler olduğunu ve dikkat edilmesi gerektiğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Gözlem Evi", sembolAnlami: "Uzak ve yakın her türlü tehlikelerden emin olmayı veya olamamayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Gözler", sembolAnlami: "Kişinin mecazi olarak görmek istemediği ya da göremediği şeyler, göz rahatsızlıklarına sebep olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Gözlük", sembolAnlami: "Daha iyi görmeyi simgeler. Kişinin yakınındaki çevresine ve şeylere olan anlık bakış açısını ifade eder. Geniş bakış açısı değildir. Kişi rüyasında gözlüğü bırakıyorsa onu almaya niyet etmelidir."),
            RuyaSembol(sembolResim: "", sembolisim: "Gözyaşı", sembolAnlami: "Şifalanmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Gri", sembolAnlami: "Belirsizliği, dengeyi, uyumlanmayı, esnekliği, arafı ve geçiş dönemlerini simgeler. Dengeyi veya dengesizliği, uyumlanmayı veya uyumsuzlanmayı yani her iki gücü de bünyesinde barındırdığı için gri, geçiş dönemlerini ifade eder. Grinin yanındaki diğer renklere veya durumlar dikkate alınarak rüyanın yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Gurbet", sembolAnlami: "Kendisini anlamayan insanların arasında olmayı, anlaşılamamayı ve yalnız hissetmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Gusül Abdesti", sembolAnlami: "Arınmayı ve kurtulmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Gül", sembolAnlami: "En yüksek frekanslı duyguyu simgeler. Manevi olarak kişinin en yüksek duyguya ulaşmasını, saf aşkı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Gümüş", sembolAnlami: "Manevi aleme hayat veren ilimleri simgeler. Şifacıdır. Anneyi de ifade edebilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Gümüş Para", sembolAnlami: "Manevi bedel ödemeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Güneş", sembolAnlami: "Madde aleme hayat veren şeyleri Rüya: ve babayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Güney", sembolAnlami: "Kişinin hangi yönden geldiğini Rüya: simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Gürültü", sembolAnlami: "Kişinin zihnindeki kargaşayı simgeler. Zihin günlük hayatın kargaşası ile öyle meşguldür ki, kişi iç sesini duyamıyordur."),
            RuyaSembol(sembolResim: "", sembolisim: "Güvercin", sembolAnlami: "İlişkilerdeki sadakati simgeler."),
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Hacca Gitmek", sembolAnlami: "Kalbe yolculuğu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Hacı", sembolAnlami: "Maneviyatını tamamlamış kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Hademe", sembolAnlami: "Hayatta kişiye hizmet eden diğer insanları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Hakem", sembolAnlami: "Oyunu kuralına göre oynamayı simgeler. Kişinin kendi halini kurallara göre şekillendirmesini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Hakim", sembolAnlami: "Adaletli karar vermeyi simgeler. Her şeyi hakkı ile bilmeyi ve hakkı ile karar vermeyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Halat", sembolAnlami: "Kişinin tutunmaya çalıştığı şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Halı", sembolAnlami: "Etnik kökeni, anane, gelenek ve göreneği simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Halife", sembolAnlami: "Manevi lideri simgeler"),
            RuyaSembol(sembolResim: "", sembolisim: "Havuz", sembolAnlami: "Kişinin bilgi birikimini ve potansiyelini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Hayalet", sembolAnlami: "Kişinin kendi yarattığı şeylere ve Rüya: korkularına inanmasını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Hayır İşlemek", sembolAnlami: "Hayır işlemeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Haykırmak", sembolAnlami: "Bkz.Bağırmak"),
            RuyaSembol(sembolResim: "", sembolisim: "Hayvan", sembolAnlami: "İnsanların hallerini ve özelliklerini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Hedefi Görmek", sembolAnlami: "Kişinin hayattaki hedeflerini anlatır."),
            RuyaSembol(sembolResim: "", sembolisim: "Hediye", sembolAnlami: "Kişinin başına gelen güzel şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Helallik İstemek", sembolAnlami: "Veda etmeyi simgeler. Bazen bir durum bazen bir olay bazen de bir kişi olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Helva Pişirmek", sembolAnlami: "Kişinin yaşadığı olumsuz durumdan sonra hayatından lezzet aldığı döneme girdiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Hemşire", sembolAnlami: "Kişiye yakın ilgi gösteren ve onu şifalandıran insanı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Hendek", sembolAnlami: "Zorluğu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Hesaba Çekilmek", sembolAnlami: "Yaptıklarının bedelini yaşamayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Hesap Pusulası (Hesap)", sembolAnlami: "Bkz.Adisyon"),
            RuyaSembol(sembolResim: "", sembolisim: "Heybe", sembolAnlami: "Kişinin hayat yolculuğunda taşıdığı ve beslendiği şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Heykel", sembolAnlami: "Bir şeye gerektiğinden fazla değer vermeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Hırka", sembolAnlami: "Babadan alınması gereken güven hissini, simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Hırsız", sembolAnlami: "Kişinin enerjisini çalan insanı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Hırsızlık", sembolAnlami: "Bkz.Gasp Edilmek"),
            RuyaSembol(sembolResim: "", sembolisim: "Hızır Aleyhisselam", sembolAnlami: "Kişinin görünmeyen fakat onu olumsuz durumdan kurtaran, iyiliklerini simgeler. Mesela kişinin sadaka vermiş olması gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Hızlı Tren", sembolAnlami: "Geleceğe giden şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Hindistan Cevizi", sembolAnlami: "Kafatasını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Horoz", sembolAnlami: "Yeni başlangıçların habercisidir."),
            RuyaSembol(sembolResim: "", sembolisim: "Hudut", sembolAnlami: "Sınırları simgeler. Kişinin kendi sınırlarına dikkat etmesini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Hücre", sembolAnlami: "Anneyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Hükümet Konağı", sembolAnlami: "Bkz.Belediye"),
            RuyaSembol(sembolResim: "", sembolisim: "Hüzün", sembolAnlami: "Güzel bir haberin geleceğini müjdeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Hz. Muhammed (S.A.V)", sembolAnlami: "Güzel ahlakı, doğru ve üstün insan olmayı simgeler. Bu rüyayı gören kişi gerçekten Peygamber Efendimizi görmüştür. Kendisinde de onun güzel ahlak, adalet gibi özellikleri aktif olmuştur. Kişinin teşekkür etmesi ve birini sevindirmesi uygun olur."),
            RuyaSembol(sembolResim: "", sembolisim: "Hz. Yusuf", sembolAnlami: "Rüyada görülen mübarek zatlar, özelliklerine göre tabir edilir. Hz. Yusuf (a.s.) en önemli özelliği rüya ilmine sahip olmasından ötürü rüya ilmini simgeler."),
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Isınmak", sembolAnlami: "Sevgi ile dolmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Isırmak", sembolAnlami: "Kişinin yanlış yaptığı şeyleri simgeler. Rüyada kişi neyin kendisini ısırdığını görüyorsa onunla ilgili yaptığı yanlış bir durum vardır. Bundan dolayı da kendisi zarar görüyordur."),
            RuyaSembol(sembolResim: "", sembolisim: "Isıtmak", sembolAnlami: "Sevgi göstermeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Iskalamak", sembolAnlami: "Acele etmemeyi ve sakin olunması gerektiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Issız Bir Yer", sembolAnlami: "Diğer insanlar tarafından aşağılanan ve değersiz kılınan kişinin, umursanmadığı, görülmediği durumda olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Işık", sembolAnlami: "Yol gösterici manevi yardımları simgeler. Sıkıntıda olan için kurtulup feraha çıkmayı, hasta için şifalanmayı müjdeler."),
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "İbadet", sembolAnlami: "Maneviyata yönelmeyi ve ibadet yapmayı simgeler. Duanın kabulünün müjdecisi gibidir."),
            RuyaSembol(sembolResim: "", sembolisim: "İbrik", sembolAnlami: "çsel, gizli arınmayı simgeler. Mesela kişi yaptığı kötü bir şey için tövbe etmiştir. Ama çevresindeki insanlar hala onu yaptığı kötü şey yüzünden yargılıyordur. Halbu ki bu kişi içsel arınmıştır."),
            RuyaSembol(sembolResim: "", sembolisim: "İç Çamaşırı", sembolAnlami: "Kişinin iç dünyasını ve kimsenin bilmediği özel hallerini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İçecek", sembolAnlami: "Bilgi almayı simgeler. Ama içeceğin muhteviyatına göre yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "İçki İçmek", sembolAnlami: "Bkz.Alkol"),
            RuyaSembol(sembolResim: "", sembolisim: "İdrar Yapmak", sembolAnlami: "Serbest bırakmayı simgeler. Mesela kişinin, eşini boşamak yerine serbest bırakması gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "İdrar Yolu Rahatsızlıkları", sembolAnlami: "İdrar yolu rahatsızlıkları, kişinin hayatında serbest bıraktıkları ya da bırakamadıkları ile ilgilidir."),
            RuyaSembol(sembolResim: "", sembolisim: "İftar Etmek", sembolAnlami: "Sabrın sonucu kazanılan mükafatı simgeler. Kişinin yakın zamanda sabrettiği bir konu hakkında selamete kavuşacağını ve mükafatını göreceğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "İftira", sembolAnlami: "İftira etmeyi ya da iftiraya uğramayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İğne", sembolAnlami: "İğne ile bir şeyi dikerken görmek, yeni bir hal oluşturmayı ifade eder. Fakat,sadece iğne görmek, kişiye rahatsızlık verebilecek ve ona batacak şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İhanet", sembolAnlami: "Aldatmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İhbar Etmek", sembolAnlami: "Haber verildiğini fakat kişinin bunu fark etmediğini ya da anlamadığını simgeler. Kişinin fark etmesi gereken şeyler olduğunu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "İhtiyar", sembolAnlami: "Ataları simgeler. Fakat yaşlı kişi beyaz sakallı ise ruhani yardımları ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "İksir", sembolAnlami: "Birden bire yüksek güce sahip olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İktidarsız Olmak", sembolAnlami: "Güçten düşmeyi simgeler. Fakat bir şeye karşı iktidarsız olmak gücün düşmesi değil ilginin düşmesini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "İl", sembolAnlami: "Kişi için neyi ifade ettiğine bakılarak rüyanın yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "İlaç", sembolAnlami: "Şifa yöntemlerini (bitki çayları, macun vs.) simgeler"),
            RuyaSembol(sembolResim: "", sembolisim: "İlahi Söylemek", sembolAnlami: "Kalp ile ruhun uyumunu simgeler. Kalpten konuşmayı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "İlan", sembolAnlami: "Arayışta iken bulmayı simgeler. Kişinin aradığı şeyi bulması yakındır."),
            RuyaSembol(sembolResim: "", sembolisim: "İlan Etmek", sembolAnlami: "Bir şeyi duyurmayı simgeler. Olduğu gibi çıkan rüyadır."),
            RuyaSembol(sembolResim: "", sembolisim: "İlkbahar", sembolAnlami: "Güzel başlangıçların arefesinde olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İlkbahar Mevsimi", sembolAnlami: "Duyguların canlanacağını müjdeler. Kişi hangi çiçeğin tomurcuğunu görüyorsa o duygusunun canlanacağını anlayabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "İltifat", sembolAnlami: "İltifat beklentisi içinde olmayı simgeler. Rüyada kişi kimden iltifat görüyorsa aslında kişi ondan takdir ve iltifat bekliyordur."),
            RuyaSembol(sembolResim: "", sembolisim: "İltihap", sembolAnlami: "Bkz. Apse"),
            RuyaSembol(sembolResim: "", sembolisim: "İmam", sembolAnlami: "Kişinin dini halini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İmdat Etmek", sembolAnlami: "Kişinin içinde bulunduğu durumdan çıkamadığını, debelenip durduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İmtihan", sembolAnlami: "İçinde bulunulan duruma sabır gösterilmesi gerektiğini simgeler. İmtihanda olduğunu fark etmesi gerektiğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "İmza", sembolAnlami: "Sözleşmeleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İnci", sembolAnlami: "Soydan gelen asilliği, asaleti, gücü ve erkek çocuğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İncir", sembolAnlami: "Sindirim ve bağışıklık sistemi ile ilgili şifalanmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İncir Ağacı", sembolAnlami: "Kişinin genlerinden gelen sindirim, bağışıklık sistemini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İnek", sembolAnlami: "Bolluğu ve zenginliği simgeler. Fakat zayıf inek kıtlığı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "İnilti Duymak", sembolAnlami: "Yardıma ihtiyacı olduğu halde yardım isteyemeyen kişiyi simgeler. Rüyayı gören kişiyi anlatabileceği gibi, inleyen kişiyi de anlatabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "İnsan Pisliği", sembolAnlami: "Emeksiz kazanılan toplu parayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İnsan Toplulukları", sembolAnlami: "Toplumu ilgilendiren şeyleri anlatır. Mübarek zatlar hariç 6 kişiden fazla insan aynı yerde görülüyorsa kollektifi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "İnşaat", sembolAnlami: "Kişinin köklü değişimler için yaptığı hazırlığı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İnternet", sembolAnlami: "Üçüncü hissi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İntihar", sembolAnlami: "Maddesel zevklerden tat alamamayı simgeler. Rüyanın genel durumuna göre iyi ya da kötü olduğu değerlendirilir."),
            RuyaSembol(sembolResim: "", sembolisim: "İntikam", sembolAnlami: "Kişinin geçmişe ait unutamadığı bir şey olduğunu ve bundan dolayı hırsla hareket ettiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İntizar", sembolAnlami: "Bkz.Beddua"),
            RuyaSembol(sembolResim: "", sembolisim: "İp", sembolAnlami: "Kişinin yaptıklarını veya yapacaklarını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İpek", sembolAnlami: "Ruhsal dönüşüm ve gelişim sürecini simgeler. İpek giymek, olumlu yönde ruhsal değişim ve dönüşüm içerisinde olmayı ifade eder. Bu rüyayı gören kişi değişim içerisinde olduğu için kendini hasta hissedebilir."),
            RuyaSembol(sembolResim: "", sembolisim: "İrin", sembolAnlami: "Bkz.Cerahat"),
            RuyaSembol(sembolResim: "", sembolisim: "İsal Olmak", sembolAnlami: "Bazı şeyleri hızlı bırakmayı simgeler. Ama çok fazla ise dengeli bırakmak gerektiğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "İsim Duymak", sembolAnlami: "İsmin anlamına dikkat edilmesi gerekir. Fakat daha çok kendi adı ile anılan, ismi kendisinden daha baskın biri ise o kişinin özelliğine bakılarak yorum yapılması gerekir. Mesela Hz. Muhammed (s.a.v), Mustafa Kemal vb."),
            RuyaSembol(sembolResim: "", sembolisim: "İskambil Kağıdı", sembolAnlami: "Boş işlerle uğraşmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İskelet", sembolAnlami: "Kişiyi ayakta tutan şeyleri simgeler. Mesela baba, anne, eş vb."),
            RuyaSembol(sembolResim: "", sembolisim: "İstifra Etmek", sembolAnlami: "Bkz.Kusmak"),
            RuyaSembol(sembolResim: "", sembolisim: "İstiğfar Etmek", sembolAnlami: "Tövbe etmeyi, duada bulunmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İsyan", sembolAnlami: "Başkaldırmayı, boyun eğmemeyi ve isyan içerisinde olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İş Yeri", sembolAnlami: "Bkz.Dükkan"),
            RuyaSembol(sembolResim: "", sembolisim: "İşportacı", sembolAnlami: "Kişinin bulunduğu işte yükseleceğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İtibar Görmek", sembolAnlami: "Kendisine değer verilen ve saygı duyulan ya da bu beklentide olan kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "İyilik Görmek", sembolAnlami: "İyilik görmeyi simgeler."),
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Kaban", sembolAnlami: "Kendini insanlardan soyutlamayı simgeler. Bu şekilde kişi kendisini korumaya almaya çalışır."),
            RuyaSembol(sembolResim: "", sembolisim: "Kabe", sembolAnlami: "Kişinin maneviyatını, kalbini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kabız Olmak", sembolAnlami: "Vazgeçememeyi veya bir şeyleri bırakmakta zorlanmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kabin", sembolAnlami: "Elbise kabini, kişinin halini değiştirmesi gerektiğini ifade edebilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Kabir", sembolAnlami: "Boş mezar, kişinin sorgulama yapmadığını; dolu mezar, kişinin sorgulama yaptığını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kabus", sembolAnlami: "Kişinin kendisiyle yüzleşmesini ve şifalanmasını simgeler. Tekrar eden kabuslar, kişinin bir şeyin etkisi altında kaldığını ve bunu anlaması gerektiğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kadı", sembolAnlami: "Adaleti sağlamayı simgeler. Fakat daha çok kişinin kendi içinde manevi konularda adaleti sağlamasını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kadın (Dişi-Dişil)", sembolAnlami: "Sanatsallığı ve üretkenliği simgeler. Rüya da görülen her kadın için geçerlidir."),
            RuyaSembol(sembolResim: "", sembolisim: "Kadife", sembolAnlami: "Yumuşak tutum ve davranışları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kafes", sembolAnlami: "Zihini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kafir", sembolAnlami: "Gerçekleri gizleyen ve kapatan kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kafiye", sembolAnlami: "Uyumlu ve güzel konuşmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kaftan", sembolAnlami: "Kişinin sözünün gücünün artmasını ve itibar kazanmasını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kahin", sembolAnlami: "Kişinin kendi içinde olan gücünü simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kahve", sembolAnlami: "Hatırı ve dostluğu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kahverengi", sembolAnlami: "Toprak enerjisini ve durağan enerjiyi ifade ettiği için, kökü ve sağlamlılığı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kaktüs", sembolAnlami: "Çok kırıcı ve iğneleyici sözler söyleyen, sivri dilli kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kalabalık", sembolAnlami: "Rüyada aynı ortamda görülen kişi sayısı altıdan fazla ise rüyanın kollektifi de ilgilendirdiğini ifade eder. Bazen de günlük yaşamın koşuşturmasını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kale", sembolAnlami: "Kişinin dışarıdan gelecek şeylere karşı kendini güvende hissettiği, emniyetli alanı simgeler. Kaygılı ve güvensiz kişiler genelde rüyasında kale görebilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Kalem", sembolAnlami: "Kişinin yazarak yaptığı her şeyi Rüya: simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kalkan", sembolAnlami: "Bazen kendini tehdit altında hissetmeyi bazen de duayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kalp", sembolAnlami: "Sevgi enerjisini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kalp Rahatsızlıkları", sembolAnlami: "Kalp rahatsızlıkları, sevgi eksikliği ile ilgilidir. Kişinin yaşadığı duygusal yoksunluğun sebebi de aileden gelir. Ailesinden sevgi görmemiş kişi, diğer insanların sevgisini kazanabilmek için, onlara çok sevgi verirler. Bundan dolayı bu tür kişiler diğer insanlara karşı çok sevgi dolu olmasına rağmen kalp rahatsızlıkları yaşarlar."),
            RuyaSembol(sembolResim: "", sembolisim: "Kambur", sembolAnlami: "Kendine her şeyi aşırı yük edinen kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kamçı", sembolAnlami: "Kişiyi teşvik eden şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kamyon", sembolAnlami: "Başkalarına ait olan yükleri Rüya: taşımayı, simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kan", sembolAnlami: "Genellikle babadan gelen aktarımları simgeler. Bazen de aile üyelerinden gelen özellikleri ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kan Kaybetmek", sembolAnlami: "Temiz kan kaybetmek, kişinin kendisine babasından aktarılan olumlu enerjileri kaybettiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kan Rahatsızlıkları", sembolAnlami: "Kan rahatsızlıkları, genelde baba ya da babanın da olduğu çekirdek aile ile ilgilidir. Fakat burada kastedilen, atalar değildir."),
            RuyaSembol(sembolResim: "", sembolisim: "Kanal", sembolAnlami: "Belirli biryerden gelen bilgi akışını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kanarya", sembolAnlami: "Konuşkan kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kanat", sembolAnlami: "Manevi yolculukları ve manevi yardımı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kanca", sembolAnlami: "Takıntılı ilişkileri simgeler. Kontrol edilemeyen düşünce, kaygı ve endişeleri ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kandil", sembolAnlami: "Zor zamanlarda gelen küçük ilahi yardımları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kangren", sembolAnlami: "Kişiyi olumsuz etkileyen baba kayıtları olduğunu simgeler. Bazen de kişinin baba soyu ile yaşadığı olumsuz ilişkileri ve durumları ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kanguru", sembolAnlami: "Sahiplenici davranmayı ve korumayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kanser", sembolAnlami: "Kişinin içinde negatif şeyler biriktirdiğini simgeler. Bu rüyayı gören kişi normal hayatta da mutlaka doktora gidip sağlık kontrolü yaptırması uygun olur."),
            RuyaSembol(sembolResim: "", sembolisim: "Kanser", sembolAnlami: "Kanser, kişinin vücudunda biriken negatif şeyler ile ilgilidir. Kanserin vücutta ilk nerede başladığı önemlidir. Buna dikkat ederek yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Kantar", sembolAnlami: "Kişinin bir şeyleri düşünüp taşınıp tartması gerektiğini simgeler. Bazen dengeyi de ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kapan", sembolAnlami: "Kişinin tehlikelere ve tuzaklara karşı daha dikkatli olması gerektiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kapanmak", sembolAnlami: "Rüyada neyin kapatıldığına ve rüyanın genel durumuna bakılarak yorum yapılması gerekir. Mesela kişi çarşaf giyerek, kendisini insanlara da kapatabilir, maneviyatına da kapanabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Kapı", sembolAnlami: "Fırsatları ve farklı boyutlara geçişi simgeler. Kişinin her açtığı kapı kendi içindeki saklı özellikleri ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kaplan", sembolAnlami: "Hızlı yaşamı simgeler. Atılgan, girişken ruhu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kaplumbağa", sembolAnlami: "Teslimiyeti simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kar", sembolAnlami: "Açığa çıkmamış bilgiyi simgeler. Zamanı gelince kişide açılacak bilgiyi ya da kişinin süzmesi gereken bilgiyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kara Çalı", sembolAnlami: "Kişiyi hasta eden durumu, olayı, kişiyi ve negatif şeyleri simgeler. Mesela kişi kendisine isabet eden nazarı, kara çalı olarak görebilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Karabasan", sembolAnlami: "Kişinin çok fazla negatif etki altında olduğunu simgeler. Mesela yoğun nazar, negatif enerjiler, büyü vs."),
            RuyaSembol(sembolResim: "", sembolisim: "Karaca", sembolAnlami: "Bkz.Geyik"),
            RuyaSembol(sembolResim: "", sembolisim: "Karaciğer", sembolAnlami: "Kök inançları ve baba aktarımlarını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Karaciğer Rahatsızlıkları", sembolAnlami: "Kişinin ya da ebeveynlerinin ailesi tarafından dışlanması, kişilerde karaciğer rahatsızlıklarına sebep olur."),
            RuyaSembol(sembolResim: "", sembolisim: "Karanfil", sembolAnlami: "Yası simgeler. Kişinin kaybettiklerini, kaybetmekten korktuklarını, kaybedip unutamadıklarını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Karanlık", sembolAnlami: "Bkz.Gece"),
            RuyaSembol(sembolResim: "", sembolisim: "Karavan Ev", sembolAnlami: "Bkz.Baraka"),
            RuyaSembol(sembolResim: "", sembolisim: "Kardaki Ayak İzi", sembolAnlami: "Gizli işleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kardelen", sembolAnlami: "Kendini ön plana çıkarmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kardeş", sembolAnlami: "Kişinin diğer olası hallerini simgeler. Rüyada görülen kardeşin yaşı, kişinin o yaştaki olasılıklarını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kare Şekli", sembolAnlami: "Evi ve konfor alanını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Karga", sembolAnlami: "İlişkilerdeki kindarlığı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Karınca", sembolAnlami: "Birlik bilincini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kartal", sembolAnlami: "İlişkilerle ilgili güçlü görüşe ve öngörüye sahip olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kartvizit", sembolAnlami: "İş yerindeki statüyü simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kas", sembolAnlami: "Anneyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kasırga", sembolAnlami: "Bkz.Fırtına"),
            RuyaSembol(sembolResim: "", sembolisim: "Kaşık", sembolAnlami: "Rızka aracılık yapan şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Katran", sembolAnlami: "Çok fazla kötü davranış ve tutum içinde olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kavak Ağacı", sembolAnlami: "Başkalarının sözlerinden çok etkilenen ve onların sözleri ile hareket eden kişiyi simgeler. Bazen de gençlik genini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kavga Etmek", sembolAnlami: "Uzlaşmayı simgeler. Şifalanma rüyasıdır. Kişi rüyasında kiminle kavga ettiğini görüyorsa ya onunla yaşadığı olayla barışıyor ya da normal hayatta kendisi ile barışıyor."),
            RuyaSembol(sembolResim: "", sembolisim: "Kavuk", sembolAnlami: "Toplum içerisindeki şinin fikirlerine ve düşüncelerine önem verilmesini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kaya", sembolAnlami: "Zorluğu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kayalık", sembolAnlami: "Kişinin hayatının zor bir döneminde olduğunu ya da başladığı işin zor olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kayan Yıldız", sembolAnlami: "Kişinin gözünden değeri düşen insanları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kaybolmak", sembolAnlami: "Duygusal olarak kaybolmayı simgeler. Kişinin yolunu bulamama, ne yapacağını bilememe halini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kayın Ağacı", sembolAnlami: "İki ailenin birleşmesini ve akraba olmasını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kayısı", sembolAnlami: "Olaylara veya durumlara geniş açıdan bakabilmeyi ve görebilmeyi simgeler. Göz yuvalarını temsil eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kaymak", sembolAnlami: "En iyisine sahip olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kaymakam", sembolAnlami: "Kişinin yaşadığı beldedeki saygınlığını simgeler. Yani o toplum içerisinde yaşayan insanların kişiye duyduğu saygıyı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kaynak Suyu", sembolAnlami: "Kaynağından gelen bilgiyi simgeler. Şifalı su, şifalı bilgiyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kaz", sembolAnlami: "Hırsı, simgeler. Bu her zaman olumsuz bir şey değildir. Rüyanın geneli dikkate alınarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Keçi", sembolAnlami: "İnatçı ve zoru seven kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Keder", sembolAnlami: "Bkz.Gam"),
            RuyaSembol(sembolResim: "", sembolisim: "Kedi", sembolAnlami: "Yüksek benliği, ruhu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kefen", sembolAnlami: "Büyük değişim için hazırlık yapmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kel", sembolAnlami: "Hislerini kabul etmeyen veya red eden kişiyi simgeler. Geçici bir durum olabilir. Saçın bir kısmı saç kıran olmuş ise, kişi sadece bir konuda hissetmek istemiyordur. Saçları seyrelmiş görmek, hislerini red etmiyor ama kişinin hislerinde azalma var."),
            RuyaSembol(sembolResim: "", sembolisim: "Kelebek", sembolAnlami: "Ruhun özgürleşmesini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kemikli Çiğ Et", sembolAnlami: "Adağı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kendinin Gömüldüğünü Göremek", sembolAnlami: "Kişinin toplum tarafından itibarsızlaştırılmaya çalışıldığını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kepçe", sembolAnlami: "Evin rızkının bollaşmasını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kerpeten", sembolAnlami: "Zorlukla alınan şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kerpiç Ev", sembolAnlami: "Kişinin genlerinden gelen maneviyatı olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kertenkele", sembolAnlami: ""),
            RuyaSembol(sembolResim: "", sembolisim: "Kervan", sembolAnlami: "Ticarete başlamak istemeyi ya da ticaret için yola çıkmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kese", sembolAnlami: "Küçük birikimleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Keşiş", sembolAnlami: "Büyük arayışlar peşinde olan kişiyi Rüya: simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kevgir", sembolAnlami: "Süzülmesi gereken şeyler olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kıble", sembolAnlami: "Kişinin manevi olarak yöneldiği şeyleri simgeler. Kıblenin değişmesi, kişinin manevi olarak yanılgıda olduğunu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kılavuz", sembolAnlami: "Rehberi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kılıç", sembolAnlami: "Adaleti sağlamayı simgeler. Güç ve kuvveti ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kına", sembolAnlami: "Manevi olarak uyumlanmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kına Gecesi", sembolAnlami: "Bkz.Bindallı"),
            RuyaSembol(sembolResim: "", sembolisim: "Kırbaç", sembolAnlami: "Bkz.Kamçı"),
            RuyaSembol(sembolResim: "", sembolisim: "Kırkayak", sembolAnlami: "Çok yönlü olan kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kırlangıç", sembolAnlami: "İlişkilerdeki ince hesapları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kırmızı", sembolAnlami: "Kökleri, üretmeyi, çabuk ve tezliği simgeler. Çabuk, tez ve acelecilik olduğu için bazen geçiciliği bazen de başlayan işi tamamlayamamayı ifade eder.Koyu kırmızı kalıcılığı temsil eder. Açık kırmızı, daha geçici ve uçucu şeyleri simgeler. Kırmızı, bazen aşkı bazen aşkla yapılan şeyleri bazen de dişiliği temsil eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kış Mevsimi", sembolAnlami: "Hayatın zor dönemini simgeler. Kişinin içinde bulunduğu sorunu bir türlü çözememesi ve bundan dolayı karamsar olmasını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kıvılcım", sembolAnlami: "Bir şeyi başlatma enerjisini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kıyafet", sembolAnlami: "Bkz.Elbise"),
            RuyaSembol(sembolResim: "", sembolisim: "Kıyamet", sembolAnlami: "Uyanışı simgeler. Kıyam etmeyi ve ayağa kalkmayı ifade eder. Kalabalık görülüyorsa, toplu uyanışı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kiler", sembolAnlami: "Kişinin sahip olduğu mal varlığını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kilim", sembolAnlami: "Bkz.Halı"),
            RuyaSembol(sembolResim: "", sembolisim: "Kilise", sembolAnlami: "Manevi yanılgıları simgeler. Kişinin manevi sandığı şeylerin aslında zihninin bir oyunu olduğunu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kilit", sembolAnlami: "Kişinin açması gereken konular ve yaşanmışlıklar olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kilolu Olmak", sembolAnlami: "Bkz.Şişman"),
            RuyaSembol(sembolResim: "", sembolisim: "Kiraz", sembolAnlami: "Kişiye keyif ve mutluluk veren anları, yeni başlangıçları simgeler. Fakat rüyada mevsiminde yenmeyen kiraz aldatıcı mutlulukları ifade eder. İkili görülen, çok görülen kiraz, bazen birden fazla kişiye aynı anda duyulan ilgiyi ve aşkı temsil eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kireç", sembolAnlami: "Temizleyen, arındıran şeyleri simgeler. Kirecin olduğu yerde temizlenmesi gereken bir şey olduğunu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kirpi", sembolAnlami: "Sınırları simgeler. Kişinin hem kendi hem de başkalarının sınırlarına dikkat etmesi gerektiğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kist", sembolAnlami: "Kişinin kurtulması veya çözmesi gereken şeyler olduğunu simgeler. "),
            RuyaSembol(sembolResim: "", sembolisim: "Kist", sembolAnlami: "Kist, iyi huylu ise; kişinin yeniden kendisinde bir oluşumu başlatması, yeniden kendisini büyütme isteği ile ilgilidir. Kist, kötü huylu ise; kanser hastalığı ile ilgilidir."),
            RuyaSembol(sembolResim: "", sembolisim: "Kitap", sembolAnlami: "Bkz.Defter"),
            RuyaSembol(sembolResim: "", sembolisim: "Koç", sembolAnlami: "Dik başlılığı, kuralları sevmemeyi, baş kaldırmayı ve lider olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Koku", sembolAnlami: "Duygunun enerjisini, frekansını simgeler. Rüyada koku varsa, gerçekten de bir olay vardır."),
            RuyaSembol(sembolResim: "", sembolisim: "Kol Saati", sembolAnlami: "Kişinin yaptığı işe ne kadar zaman harcadığını gösterir."),
            RuyaSembol(sembolResim: "", sembolisim: "Kollar", sembolAnlami: "Güç ve girişkenliği simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Koltuk", sembolAnlami: "Bkz.Çekyat"),
            RuyaSembol(sembolResim: "", sembolisim: "Kolye", sembolAnlami: "Görevlendirmeyi hem de Rüya: onurlandırmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Komşu", sembolAnlami: "Yakın çevreyi ve yakın ilişkileri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Konferans", sembolAnlami: "Bir şeyler öğrenmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kontrat", sembolAnlami: "Bkz.Sözleşme"),
            RuyaSembol(sembolResim: "", sembolisim: "Konuşmalar", sembolAnlami: "Rüyadaki konuşmalar oradaki durum hakkında bilgi verir."),
            RuyaSembol(sembolResim: "", sembolisim: "Kor", sembolAnlami: "Söndü zannedilen ama içten içe yanan, sönmeyen öfkeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Koyun", sembolAnlami: "Birlikte hareket etmeyi bazen de çoğalmayı ve bereketi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Koza", sembolAnlami: "Değişim ve dönüşümü simgeler. Bu dönüşüm için kişinin içine kapandığı dönemi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Köpek", sembolAnlami: "Zihin, ego ve nefsi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Köpek Balığı", sembolAnlami: "Saldıran ya da korkutan sezgileri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Köprü", sembolAnlami: "Geçiş yapmayı simgeler. Asma köprü, zorlu geçişi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kör", sembolAnlami: "Bkz.Ama"),       /////
            RuyaSembol(sembolResim: "", sembolisim: "Kör Olmak", sembolAnlami: "Bkz.Ama"), /// /
            RuyaSembol(sembolResim: "", sembolisim: "Köstebek", sembolAnlami: "Gizliden gizliye yürütülen işleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Köy", sembolAnlami: "Ata kayıtlarını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Köy Evi", sembolAnlami: "Ata evini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kuaför", sembolAnlami: "Bkz.Berber"),
            RuyaSembol(sembolResim: "", sembolisim: "Kuduz", sembolAnlami: "Egonun esiri olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kuğu", sembolAnlami: "Zerafeti simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kulak", sembolAnlami: "Kişinin duymak istemediklerini duyması kulak rahatsızlıklarına sebep olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Kule", sembolAnlami: "Olumlu veya olumsuz olarak yükselmek. Mesela iyi veya kötü şeylerin yükselmesi gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Kuma", sembolAnlami: "Bkz.Aldatma"),
            RuyaSembol(sembolResim: "", sembolisim: "Kumar Oynamak", sembolAnlami: "Gereksiz yere alınan riskleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kumarhane", sembolAnlami: "Kişinin bir risk ortamında olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kumaş", sembolAnlami: "Kişinin ailesinden aldığı karakteristik özellikleri simgeler. Sert kumaş, kişinin tabiatının sert olduğunu; çiçekli kumaş, cıvıl cıvıl bir insan olduğunu; ipek kumaş, kişinin değişim içinde olduğunu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kumru", sembolAnlami: "Özel ilişkileri simgeler. Tek kumru görmek, yalnızlığı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kur'an-ı Kerim", sembolAnlami: "Hüküm, emir ve kılavuzu simgeler. "),
            RuyaSembol(sembolResim: "", sembolisim: "Kurbağa", sembolAnlami: "Önemli olduğu halde, kişi tarafından önemsiz görülen şeyleri simgeler. Küçük, mide bulandıran gibi görünen fakat üzerine düşüldüğü zaman kişi için mucizelere dönüşebilecek şeyleri ifade eder. Şu an rahatsız olduğun beğenmediğin ama sevgiyle güzelleşecek şeyleri temsil eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kurban", sembolAnlami: "Feda edilmesi gereken şeyleri simgeler. Kurbanlık almak, kişinin kurban etmesi gereken şeyleri olduğunu ifade eder. Kurban bayramı görmek, kişi için sevindiricidir."),
            RuyaSembol(sembolResim: "", sembolisim: "Kurşun", sembolAnlami: "Kuvvetlenmeyi simgeler. Fakat rüyada nasıl birinin vurulduğuna dikkat edilerek yorum yapılması gerekir. Mesela kötü bir insanı vurmak, kişinin kötü yanını güçlendirmiş olduğunu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kurşun", sembolAnlami: "Bkz.Silah"),
            RuyaSembol(sembolResim: "", sembolisim: "Kurt", sembolAnlami: "Aile bağları kuvvetli olan ve güçlü sezgilerini hayata yansıtabilen kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kurtçuk", sembolAnlami: "İçten içe kişiyi kemiren dertleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kuruş Para", sembolAnlami: "Değersiz maddesel şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kusmak", sembolAnlami: "Hazmedilmeyen şeylerden iyileşmeyi simgeler. Şifalanmayı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kuş", sembolAnlami: "nsanlarla olan ilişkileri simgeler. Eril-dişil dengesini de ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kuş Tüyü", sembolAnlami: "İlahi mesajları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kuşak", sembolAnlami: "Aile ve soya bağlı olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kutlmama", sembolAnlami: "Bir olayın veya durumun mutlu Rüya: sonuçlanmasını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kuyruk", sembolAnlami: "Kişiyi takip eden hemde peşinden gelen insanları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kuyu", sembolAnlami: "Çaresizliği simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kuyudan Su İçmek", sembolAnlami: "Öğrenilmiş çaresizliği, simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kuzey", sembolAnlami: "İstikameti simgeler. Kişinin gittiği yönü ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kükremek", sembolAnlami: "Sözünü geçirmeyi simgeler. Rüyada ne kükrerse kişi sözünü orada onunla geçirir."),
            RuyaSembol(sembolResim: "", sembolisim: "Küpe", sembolAnlami: "İdrak edilmemiş bilgiyi simgeler. Edinilen ama anlaşılamayan bilgiyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Kürsü", sembolAnlami: "Akademik başarıyı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Kütük", sembolAnlami: "Sabit fikirli insanları simgeler. Genlerindeki aktarımlarından kaynaklı sabit düşünceli olan ve o şekilde davranan insanları ifade eder."),
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Labirent", sembolAnlami: "Zihin karışıklığını simgeler. Bu durumda olan bir kişi, ne yapacağını bilemiyor, sorularının cevabını göremiyor ve çok plan yapıyor olabilir. Bu rüyayı gören kişi, ruhunun sesini duymaya niyet etmelidir."),
            RuyaSembol(sembolResim: "", sembolisim: "Lacivert", sembolAnlami: "Ciddiyeti ve önemli konuşmaları, iletişimleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Lağım", sembolAnlami: "Gerçek olmayan olumsuz bir durumu kişiye yükleyerek onu karalamaya çalışan insanların olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Lale", sembolAnlami: "Onurlu olmayı ve sadece Allah'tan beklemeyi simgeler. Bazen dik kafalılığı da ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Lamba", sembolAnlami: "Direk ilahi kaynaktan gelmeyen yardımları simgeler. Mesela kişinin diğer insanlardan yardım alması gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Lastik", sembolAnlami: "Konunun gerektiğinden fazla uzamasını ve iki yüzlü davranmayı simgeler. Rüyada lastik kimin elinde ise ona göre yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Lehim Yapmak", sembolAnlami: "Güçleri birleştirmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Leylek", sembolAnlami: "İlişkilerdeki açılımları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Liman", sembolAnlami: "Güvende olmayı simgeler. Kişinin sığındığı insanları vs. ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Limon Çiçeği", sembolAnlami: "Canlılığı ve canlanmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Lunapark", sembolAnlami: "Kişinin içinde bulunduğu durum ile yüzleşmemek için kendisini eğlenceye verdiğini ifade eder."),
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Mabed", sembolAnlami: "Bkz.Kilise"),
            RuyaSembol(sembolResim: "", sembolisim: "Maç", sembolAnlami: "Kuralına göre davranmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Madalya", sembolAnlami: "Kişinin başarısının kabul görmesini, onaylanmasını ve takdir edilmesini simgeler. Fakat bu başarı kişinin görevinden ziyade yaptığı iş ile ilgilidir."),
            RuyaSembol(sembolResim: "", sembolisim: "Maden", sembolAnlami: "Kişinin özünde olan, kaynağı simgeler. Devamı olan şeyleri ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Madenci", sembolAnlami: "Kişinin özünde olan kaynağı yani potansiyeli keşfetmeye çalışmasını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Madeni Para", sembolAnlami: "Sadaka verilmesi gerektiğini ifade Rüya: eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Mağara", sembolAnlami: "Anne rahmini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Mağaza", sembolAnlami: "Bkz.Dükkan"),
            RuyaSembol(sembolResim: "", sembolisim: "Mağlubiyet", sembolAnlami: "Rüyada bir şeye yenilmek, kişinin yenildiği şeyle ilgili normal hayatta olumlu ve iyi bir sonuç elde etmesini simgeler. Fakat rüyada bir şeye galip gelmek, kişiye bunu yaparsan kazanırsın deme şeklini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Mahalle", sembolAnlami: "Yakın çevreyi simgeler. Fakat bu rüya kişinin yakın çevresini de ilgilendirdiğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Mahale Mezarlığı", sembolAnlami: "Yakın çevrenin değiştirilmesi gerektiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Mahkeme", sembolAnlami: "Vicdanı simgeler. Kişinin iç hesaplaşmasını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Mahkum", sembolAnlami: "Sadece mahkum edildiğini görmek, kişinin iç hesaplaşmasında başarılı olduğunu simgeler. Sadece zindan görmek, kişinin zihinde kaldığını ifade eder. Beraat ettiğini görmek, kişinin iç hesaplaşmasını yapamadığını temsil eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Mahsen", sembolAnlami: "Bkz.Bilinçaltı"),
            RuyaSembol(sembolResim: "", sembolisim: "Mahşer", sembolAnlami: "İçinde bulunulan durumun en karışık fakat çözüme en yakın olduğu dönemi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Makam", sembolAnlami: "Yükselmeyi simgeler. Rüyada görülen makama göre yorumlanması gerekir. Kişi hangi makamı gördüyse, o makamın özelliğine göre yükselir."),
            RuyaSembol(sembolResim: "", sembolisim: "Makas", sembolAnlami: "Kesmeyi simgeler. Rüyada neyin kesildiğine bakılarak yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Makyaj", sembolAnlami: "Kişiye hoş görünmeye çalışan insanlar olduğunu simgeler. Fakat sadece gözde sürme görmek, kişinin görmesi gereken şeyler olduğunu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Manastır", sembolAnlami: "Dünyadan elini eteğini çekmeyi ve anlam arayışına girmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Manda", sembolAnlami: "Köklerden yani aileden gelen zenginliği simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Mandal", sembolAnlami: "Kişinin yenilenmesi gerektiği mesajını, simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Mandıra", sembolAnlami: "Büyük bir feraha ve bolluğa kavuşmayı simgeler. Fakat zenginlik değildir."),
            RuyaSembol(sembolResim: "", sembolisim: "Mantar", sembolAnlami: "Frekansı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Manto", sembolAnlami: "Bkz.Kaban"),
            RuyaSembol(sembolResim: "", sembolisim: "Marangoz", sembolAnlami: "Genetik özellikleri düzeltmeye ve şekillendirmeye çalışmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Martı", sembolAnlami: "İlişkilerde özgürlüğü tercih eden kişiyi simgeler. Bundan dolayı bazen martı, çapkınlığı da ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Masa", sembolAnlami: "Evde rızkı simgeler. Fakat iş yerinde görülen masa, anlaşmaları ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Maske", sembolAnlami: "İki yüzlüğü ve samimiyetsizliği simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Matematik", sembolAnlami: "Rüyada işlem yapmak, hesap yaparak ilerlemek gerektiğini ya da karşı tarafın yaptığı hesapları görmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Mavi", sembolAnlami: "İletişimi, özgürlüğü ve dinginliği Rüya: simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Maya", sembolAnlami: "Başkasının bilgisinden ve tecrübesinden faydalanarak kişinin bir şeye hazırlandığını simgeler. Mesela staj yapmak, usta çırak ilişkisi vb."),
            RuyaSembol(sembolResim: "", sembolisim: "Maymun", sembolAnlami: "Pozitif, eğlenceli ve ciddiye almayan kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Medrese", sembolAnlami: "Kişinin hayatında öğrendiği manevi değerleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Medyum", sembolAnlami: "Bkz. Kahin"),
            RuyaSembol(sembolResim: "", sembolisim: "Mekke", sembolAnlami: "Kalbimizi simgeler. Denge noktasını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Mektep", sembolAnlami: "Eski kadim bilgileri simgeler. Eski bir okul yani mektep görmek kişinin dikkatini eski kadim bilgilere vermesi gerektiğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Mektup", sembolAnlami: "Kişinin, herhangi bir sebepten dolayı bazı insanlarla duygu, düşünce ve bilgi alışverişinde bulunamadığını fakat onlarla iletişime geçme isteği içerisinde olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Melek", sembolAnlami: "İyilik görmeyi ve kişideki iyilik Rüya: halinin çoğalmasını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Melek Kanadı", sembolAnlami: "İlahi bilgiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Meme", sembolAnlami: "Bkz.Göğüs"),
            RuyaSembol(sembolResim: "", sembolisim: "Mendil", sembolAnlami: "Emeği simgeler. Mendilin rengi de emeği veren kişinin duygu durumunu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Menekşe", sembolAnlami: "Değerlilik duygusunu, simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Merasim", sembolAnlami: "Bir şeyin gerektiğinden fazla uzamasını simgeler. Rüyada görülen merasimin ne olduğuna bakılarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Merdiven", sembolAnlami: "Merdiven çıkmak, başarıyı; merdiven inmek, kısa süreli başarısızlığı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Merdiven Çiçeği", sembolAnlami: "Hayatın başarıya doğru giden dönemini, simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Merhem", sembolAnlami: "Kişinin yarasına ilaç olan şeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Merkep", sembolAnlami: "Bkz.Eşek"),
            RuyaSembol(sembolResim: "", sembolisim: "Mescit", sembolAnlami: "Mescit, arada Allah'tan manevi yardım istemeyi simgeler. Mescit süpürmek, arada manevi rehberlerden ilim talep etmeyi simgeler. Kişi rüyada mesciti süpürürken görüyorsa, talebeliğe kabul edilmiş demektir."),
            RuyaSembol(sembolResim: "", sembolisim: "Meşale", sembolAnlami: "Yaşam boyu devam eden eğitim ve öğretim sürecini simgeler. Meşaleyi elinde tutmak, öğretmeye başlamayı; uzaktan ışığını görmek, öğrenmeye ya da idrak etmeye başlamayı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Meşe Ağacı", sembolAnlami: "Çekirdek aileyi ve aile olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Meşe Palamudu", sembolAnlami: "Ailede birey olmayı ve sorumluluk bilincini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Metal", sembolAnlami: "Kuvveti, simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Metre", sembolAnlami: "Ölçülü hareket etmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Metres", sembolAnlami: "Bkz.Aldatma"),
            RuyaSembol(sembolResim: "", sembolisim: "Mevlid", sembolAnlami: "Kişinin maneviyatına yönelmesi ve frekansını yükseltmesi gerektiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Meydana Çıktığını Görmek", sembolAnlami: "Meydan, ön plana çıkmayı ve görünür olmayı simgeler. Meydanda kalabalık görmek, bazı toplumsal iyi veya kötü olayların ortaya çıkacağını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Meyve Ağacı", sembolAnlami: "Meyve ağacı görmek, kişinin diğer insanlara nasıl faydalı olduğunu simgeler. Fakat tek başına meyve görmek, kişinin neden fayda aldığını ifade eder. Fakat ısırılmış elma görmek, yasak hayat demektir."),
            RuyaSembol(sembolResim: "", sembolisim: "Meyve Bahçesi", sembolAnlami: "Bkz. Meyve Ağacı"),
            RuyaSembol(sembolResim: "", sembolisim: "Meyve Çiçekleri", sembolAnlami: "Geçici olan duyguları simgeler. Mesela, eşi ile tartışan kişinin kendisini değersiz hissetmesi ve hemen sonrasında eşinin gelip ondan özür dilemesi ile bu duygusunun geçmesi gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Mezar", sembolAnlami: "Bkz.Kabir"),
            RuyaSembol(sembolResim: "", sembolisim: "Mezarcı", sembolAnlami: "Sorgulamana sebep olan kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Mezba", sembolAnlami: "Kişinin feda etmesi gereken çok şey olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Mıknatıs", sembolAnlami: "Güçlü çekim alanına sahip olmayı simgeler. Gücü ve kuvveti çekmeyi ifade eder. Rüyada mıknatısın yanında olan şeye bakarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Mide", sembolAnlami: "Kişinin hazmettiklerini veya hazmedemediklerini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Mide Bulantısı", sembolAnlami: "Kişinin hazmetmemesi gereken şeyler olduğunu simgeler. Bu rüyayı gören kişinin kusması gerekir. Çünkü kusmak, kişinin hazmedemediği şeylerden iyileşmesidir."),
            RuyaSembol(sembolResim: "", sembolisim: "Mide Rahatsızlıkları", sembolAnlami: "Mide rahatsızlıkları, kişinin hazmettikleri veya hazmedemedikleri, direnç gösterdikleri veya göstermedikleri ile ilgilidir. Mide rahatsızlıklarının temelinde anne ile ilgili sorunlar vardır."),
            RuyaSembol(sembolResim: "", sembolisim: "Mikrofon", sembolAnlami: "Sesini kitlelere duyurmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Mimar", sembolAnlami: "Kişinin kendisini yenilemesini ya da diğer insanların kişisel gelişimine yardımcı olmasını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Minare", sembolAnlami: "Maneviyata çağrı yapmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Minibüs", sembolAnlami: "Toplulukla hareket etmeyi simgeler. Fakat kişi istediği zaman katıldığı topluluktan ayrılabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Miraç", sembolAnlami: "Manevi yükselişi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Miras", sembolAnlami: "Atalardan kişiye aktarılan özellikleri ve bu özelliklerin ortaya çıkmasını simgeler. Mesela yetenek gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Misafir", sembolAnlami: "Gelecek duygu, durum ve olayları simgeler. Götürmesi de kişideki kayıpları ifade eder. Gelen misafir elinde ne getirmişse ya da ne götürüyorsa ona bakılarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Misafirhane", sembolAnlami: "Bir sürü durum ve olayın kişiye geleceğini simgeler. Misafir olarak gelen kişiye dikkat edilmesi gerekir. Çünkü gelen kişi mübarek bir zat olabilir. Rüyayı gören kişi , kendisinden yardım isteyen insanlara çok dikkat etmesi ve onlara nazik davranması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Misket", sembolAnlami: "Çocukların sevincini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Misvak", sembolAnlami: "Aile içindeki bağların güçlenmesini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Mor", sembolAnlami: "Bilgeliği simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Morfin", sembolAnlami: "Kişinin içinde bulunduğu durumu veya olayı unutarak, rahatlamak ve uyuşmak istediğini simgeler. Derin bir gaflet haline dalmayı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Mozaik", sembolAnlami: "Kişinin yaşamı boyunca anlamlandıramadığı fakat bir araya getirince kendisinde bir anlam ifade eden şeyleri simgeler. Dikkat! Puzzle (Bkz. Puzzle) ile karıştırma."),
            RuyaSembol(sembolResim: "", sembolisim: "Mucize", sembolAnlami: "Mucizeye şahit olmayı simgeler. Her an her saniye mucize olur fakat kişi göremez. Ama artık bu rüyayı gören kişi mucizelere tanık olacaktır."),
            RuyaSembol(sembolResim: "", sembolisim: "Muhabbet Kuşu", sembolAnlami: "Kişinin sevdiği insanlarla arasındaki muhabbetini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Muhafız", sembolAnlami: "Korkudan emin olmayı ve güvende olmayı simgeler. Kişinin sığındığı insanları vs. ifade eder. Muhafızın iyi veya kötü olması kişinin nasıl bir yere dayandığı hakkında fikir verir."),
            RuyaSembol(sembolResim: "", sembolisim: "Muhasebeci", sembolAnlami: "Bazı şeylerin muhasebesinin yapılması gerektiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Muhtar", sembolAnlami: "Rüyanın, yaşanılan mahalle ile ilgisi olduğunu ifade eder. Eğer rüyayı gören kişinin muhtara karşı farklı duygusu varsa o özellik de göz önünde bulundurularak rüya yorumu yapılması gerekir.  Ayrıca kişi kendini muhtar olarak görüyorsa; bu rüya herşeyden haberdar olmayı temsil edeceği gibi kişinin böyle bir çevreye sözünün geçeceğini de anlatır."),
            RuyaSembol(sembolResim: "", sembolisim: "Mukabele", sembolAnlami: "Hayatla yapılan sözleşmeleri simgeler. Mesela kişinin kendi içinden yaptığı kınamalar, yargılamalar ya da ben olsam asla bunu yapmazdım dediği şeyler vs. Bu rüyayı gören kişi hangi konuda büyük konuştuğuna bakması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Mum", sembolAnlami: "Kendisine faydası olmayan ama başkasına faydası olan kişiyi simgeler. Rüyasında mumu gören kişi vazgeçmemelidir."),
            RuyaSembol(sembolResim: "", sembolisim: "Mumya", sembolAnlami: "Kişinin yaşatmaya çalıştığı, vazgeçemediği şeyleri simgeler. Neyin mumyalandığı dikkate alınarak rüyanın yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Mutfak", sembolAnlami: "Bkz.Evin Mutfağı"),
            RuyaSembol(sembolResim: "", sembolisim: "Mücevher", sembolAnlami: "Kişinin kendi özünde olan yetenek üstü cevherlerini simgeler. Mesela kişinin matematik konusunda bir deha olması gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Müdür", sembolAnlami: "Diğer insanları yöneten kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Müezzin", sembolAnlami: "Maneviyata çağıran rehber kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Mühendis", sembolAnlami: "Ne mühendisi ise o alan ile ilgili kişinin bazı şeyleri gözden geçirmesi gerektiğini ve bir hesap kitap yapması gerektiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Mühlet Vermek", sembolAnlami: "Bir konu ile ilgili kişiye verilen ya da bununla ilgili kişinin kendisine verdiği zamanı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Mühür", sembolAnlami: "Bir konuya kesinlik kazandırmayı simgeler. Mühür kimin elinde ise ya da kime veriliyorsa gücün onda olduğunu ifade eder. Mühürlemek, o şeye kesinlik ve netlik kazandırmaktır."),
            RuyaSembol(sembolResim: "", sembolisim: "Münakaşa", sembolAnlami: "Bkz.Kavga"),
            RuyaSembol(sembolResim: "", sembolisim: "Müneccim", sembolAnlami: "Astroloji ile uğraşan insanı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Mürşid", sembolAnlami: "Bkz.Evliya"),
            RuyaSembol(sembolResim: "", sembolisim: "Müzik", sembolAnlami: "Ruhun titreşimini, frekansı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Müzik Aleti Çalmak", sembolAnlami: "Bkz.Çalgı Çalmak"),
            RuyaSembol(sembolResim: "", sembolisim: "Müzik Dinlemek", sembolAnlami: "Ruhu dinlemeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Müzisyen", sembolAnlami: "Kişinin ruhu ile aynı frekansta titreşmesini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Nadasa Bırakmak", sembolAnlami: "Kişinin bedenini dinlendirmesi gerektiğini simgeler. Kişinin bu şekilde daha verimli çalışabileceğini anlatır."),
            RuyaSembol(sembolResim: "", sembolisim: "Nafaka Vermek", sembolAnlami: "Kişinin bakmakla yükümlü olduğu insanlara karşı sorumluluğunu yerine getirmemesini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Nakış İşlemek", sembolAnlami: "İnce ince işlenmiş ve çok emek verilmiş şeyleri simgeler. Mesela sabırla bir çocuğu büyütmek, bir ürünü marka haline getirmek vb."),
            RuyaSembol(sembolResim: "", sembolisim: "Namaz Kılmak", sembolAnlami: "Tamamen Allah'a ve maneviyata yönelmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Nane", sembolAnlami: "Ferahlığı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Nar", sembolAnlami: "Kişiye sürpriz olan ve hiç beklemediği kadar bereketli olan şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Nasır", sembolAnlami: "Verilen emeğin takdir edildiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Nefes", sembolAnlami: "Kişinin yaşadığı yerden veya bulunduğu ortamdan duyduğu rahatsızlığı ya da huzuru simgeler. Bu durum ortamdan ya da ortamdaki insanlardan kaynaklıdır."),
            RuyaSembol(sembolResim: "", sembolisim: "Nefes Rahatsızlıkları", sembolAnlami: "Nefes rahatsızlıkları, kişinin yaşadığı veya bulunduğu ortamdan duyduğu rahatsızlık ile ilgilidir. Kişinin mutlu olmaması, ortamdan ya da ortamdaki insanlardan kaynaklı olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Negatif Varlıkları Hissetmek", sembolAnlami: "Negatif enerjilerin etkisinde olmayı simgeler. Bu rüyayı gören kişi tekrardan rüyaya niyet edip ne yapmalıyım diye sormalıdır."),
            RuyaSembol(sembolResim: "", sembolisim: "Nergiz Çiçeği", sembolAnlami: "Bazen narsistliği bazen de empatlığı simgeler. Bundan dolayı rüyanın geneli dikkate alınarak yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Ney", sembolAnlami: "Nefsin isteklerinden kurtulmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Nikah", sembolAnlami: "Bazen evliliğin bazende ortaklığın kişiler arasında yapılan sözleşmesini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Nilüfer Çiçeği", sembolAnlami: "Kendisine ve çevresindekilere faydalı olan kişiyi simgeler. Korumayı, kollamayı ve anaçlığı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Nine", sembolAnlami: "Ataları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Nişan (Madalya)", sembolAnlami: "Bkz.Madalya"),
            RuyaSembol(sembolResim: "", sembolisim: "Nişan Almak", sembolAnlami: "Hedef belirlemeyi ve o doğrultuda hareket etmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Nişanlamak", sembolAnlami: "Evliliğe veya ortaklığa hazırlığı simgeler. İlişkilerle ilgili verilen sözleri ve ortaklıkları ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Noktalama İşaretleri", sembolAnlami: "Noktalama işaretleri, gerçek kullanımlarına göre yorumlanır."),
            RuyaSembol(sembolResim: "", sembolisim: "Noter", sembolAnlami: "Bir şeye resmiyet kazandırarak onu güvence altına almayı ve durumu tasdik etmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Nur", sembolAnlami: "Allah'tan güç alarak aydınlanmayı ve yardım almayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Nüfus Kağıdı", sembolAnlami: "Toplumda kabul görmeyi simgeler."),
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Oba", sembolAnlami: "Toplumda sözü geçen itibarlı kişileri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Oda", sembolAnlami: "Bkz.Evin Odaları (Evin her odası kişinin başka bir halini ve potansiyelini simgeler.)"),
            RuyaSembol(sembolResim: "", sembolisim: "Ofis", sembolAnlami: "Bkz.Dükkan"),
            RuyaSembol(sembolResim: "", sembolisim: "Ok", sembolAnlami: "Hedefe ulaşmak için verilen çabayı imgeler. Atılan ok, kişinin neyi hedeflediğini gösterir."),
            RuyaSembol(sembolResim: "", sembolisim: "Okçu", sembolAnlami: "Bir amacı ve hedefi olan kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Okul", sembolAnlami: "Hayatı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Okumak", sembolAnlami: "İşaretleri okuyarak hayatı anlamak ve anlayabilmek kapasitesini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Okyanus", sembolAnlami: "Derin ve yüksek bilgiye sahip olmayı, ülkenin sınırlarını aşarak dünyaya açılmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Olta", sembolAnlami: "Sezgileri fark etmeyi ve onları anlamayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Omuz", sembolAnlami: "Güveni simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Omuzlar", sembolAnlami: "Tek bir omuz, güveni simgeler. Fakat iki omuz yani kürek kemiği kişinin terazisidir. Bundan dolayı omuzlar, alma verme dengesini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Omuz Rahatsızlıkları", sembolAnlami: " Omuz rahatsızlıkları, kişinin hayatında bazen alma verme dengesini kuramaması bazen de haram ve helal ile ilgili olabilir. Hayatınızda denge kuramadığınız her şeyde bu bölge etkilenir. Omuz simetriğinin bozulması da alma ve verme dengesinin bozulmasından kaynaklı oluşur."),
            RuyaSembol(sembolResim: "", sembolisim: "Optik", sembolAnlami: "Olaylara ve durumlara daha geniş bakış açısıyla bakılması gerektiğini simgeler. Farklı bakış açılarını yakalamayı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Orak", sembolAnlami: "Toplamayı simgeler. Rüyada kişinin neyi topladığına bakılarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Ordu", sembolAnlami: "Bkz.Garnizon"),
            RuyaSembol(sembolResim: "", sembolisim: "Orkide", sembolAnlami: "Kendini özel hissetmeyi, simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Orman", sembolAnlami: "Kişinin sahip olduğu tüm genleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Oruç Tutmak", sembolAnlami: "İradeyi simgeler. Oruçlu olduğunu görmek, kişinin sabırla ilgili bir imtihanı olduğunu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Ot", sembolAnlami: "Her türlü yeşillik, ot şifayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Otel", sembolAnlami: "Kişinin geçici bir durum içerisinde olduğunu simgeler. Geçici bir dönemi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Otobüs", sembolAnlami: "Topluluğu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Otobüse Binmek", sembolAnlami: "Toplulukla beraber hareket etmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Otogar", sembolAnlami: "Kişinin hedefine ulaşmak için hangi toplulukla hareket edeceğine karar vermesini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Otomobil", sembolAnlami: "Bkz.Araba"),
            RuyaSembol(sembolResim: "", sembolisim: "Oturma Odası", sembolAnlami: "Bkz.Evin Misafir Odası (Salon)"),
            RuyaSembol(sembolResim: "", sembolisim: "Oynamak", sembolAnlami: "Müzik eşliğinde oynamak, ruh ve bedenin uyumunu simgeler. Müziksiz oynamak, kişinin yaptıkları ile ruhunun uyumlu olmadığını ifade eder. Fakat saçma sapan oynamak iyi değildir."),
            RuyaSembol(sembolResim: "", sembolisim: "Oyun Oynamak (İskambil Kağıdı Gibi)", sembolAnlami: "Boş işlerle uğraşmayı ve zamanı boşa harcamayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Ozan", sembolAnlami: "Kalbi sözlerine yansıyan ve güzel konuşan kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Ödem", sembolAnlami: "Kişinin kendisine verdiği zararı Kişi, kolunda ödem gördü. simgeler. Vücudun bu zarara karşı Kişi kolu ile kendisine zarar savunmaya geçtiğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Öğretmen", sembolAnlami: "Manevi rehberleri simgeler. Kişiye rehberlik eden insanları ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Öküz", sembolAnlami: "Bkz.Boğa"),
            RuyaSembol(sembolResim: "", sembolisim: "Ölmek (Ölüm)", sembolAnlami: "Yeni başlangıçları simgeler. Bir başka kişinin öldüğünü görmek, o kişinin en önemli özelliği ne ise rüyayı gören kişide o özelliğin ölmesini ifade eder. Ölmüş birini yıkamak, o kişinin en önemli özelliği ne ise rüyayı gören kişinin o özellikten arınmasını temsil eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Ölmüş Kişileri Görmek", sembolAnlami: "Ölen kişinin konuştuğu görülüyorsa, bu rüyalar daha çok semboliktir. Eğer ölen kişi konuşmuyorsa, o an onun gerçek ruhu olduğu hissediliyor ve onunla his yoluyla konuşuluyorsa, ölen kişinin kendisidir."),
            RuyaSembol(sembolResim: "", sembolisim: "Öpüşmek", sembolAnlami: "Anlaşmayı, aynı şeyi konuşmayı ve sevgi alışverişinde bulunmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Örtmek", sembolAnlami: "Bir şeyi gizlemeye çalışmayı simgeler. Örtünün görüldüğü yere göre rüyanın yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Örümcek", sembolAnlami: "Bkz.Ağ"),
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Paçavra", sembolAnlami: "Karakter sergileyememeyi ya da kendini değersiz hissetmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Padişah", sembolAnlami: "Ün, şöhret, nam, saygınlık ve itibar kazanmayı simgeler. Çok zengin olmayı, mevki sahibi olmayı ve saltanat sürmeyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Padişah Tahtı", sembolAnlami: "Geçici bir güç olmadığını simgeler"),
            RuyaSembol(sembolResim: "", sembolisim: "Palto", sembolAnlami: "Bkz.Manto"),
            RuyaSembol(sembolResim: "", sembolisim: "Palyaço", sembolAnlami: "Diğer insanları eğlendirip ona neşe saçarken kendi içinde fırtınalar kopan kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Pamuk", sembolAnlami: "Huzur vermeyi ve huzurlu olmayı simgeler. Bazen de yumuşak huyu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Panda", sembolAnlami: "Rahatına düşkün olan tembel ve mutlu kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Panjur", sembolAnlami: "Bilmez ayağına yatmayı bazen de sinsiliği simgeler. Aslında her şeyin farkında olmasına rağmen kişinin, bilmiyormuş gibi davranmasını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Panzehir", sembolAnlami: "Kişinin, kimyasını bozan şeyleri fark etmesini ve onları dönüştürmesini simgeler. Genellikle de olumsuz düşünce ve inançları fark etmesini, dönüştürmesini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Papağan", sembolAnlami: "Dedikodu ve gevezeliği simgeler. İlişkilerde aynı şeyi tekrar etmeyi, kendi fikri olmadığı halde başkalarından duyduğunu söylemeyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Papatya", sembolAnlami: "Yeni başlangıçları simgeler. Heyecan ve uyanışıda ifadeeder."),
            RuyaSembol(sembolResim: "", sembolisim: "Papaz", sembolAnlami: "Manevi konuları yanlış Rüya: yorumlamayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Papuç", sembolAnlami: "Bkz.Ayakkabı"),
            RuyaSembol(sembolResim: "", sembolisim: "Para", sembolAnlami: "Maddesel olarak bedel ödemeyi simgeler. Para vermek, bir bedel ödemeyi; para almak, bir bedel almayı ifade eder. Fakat bazen para, maddesel yükleri de temsil eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Para Ödemek", sembolAnlami: "Bkz.Ücret Ödemek"),
            RuyaSembol(sembolResim: "", sembolisim: "Paralı Kimse", sembolAnlami: "Maddesel değerlere önem vermeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Parfüm", sembolAnlami: "Hoş gelen ama gerçek olmayan duyguları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Parlaklık", sembolAnlami: "Bitki ve hayvanları rüyada parlak görmek, gösterişi simgeler. Fakat diğer şeyler için bu durum geçerli değildir."),
            RuyaSembol(sembolResim: "", sembolisim: "Parmak", sembolAnlami: "Özgünlüğü simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Parmaklar", sembolAnlami: "Kişinin, marifetlerini simgeler. Elinden gelen işleri ve becerilerini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Paslanmış Bir Şey Görmek", sembolAnlami: "Kişinin uzun zamandır kullanmadığı fakat kullanması gereken şeyi simgeler. Rüyada neyin paslandığı dikkate alınarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Paspas", sembolAnlami: "Kişinin kendi değerini düşürdüğünü veya hakkını çiğnettiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Pazar", sembolAnlami: "Bkz. Alışveriş"),
            RuyaSembol(sembolResim: "", sembolisim: "Peçe", sembolAnlami: "Sözünü saklamayı ya da sözünün değersiz olduğunu düşünmeyi simgeler. Bir sözün üstünü örtmeyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Pembe", sembolAnlami: "Hayalleri ve yaratıcılığı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Pençe", sembolAnlami: "Kişinin elini attığı işten başarı ile çıkmasını simgeler. Mücadelesindeki başarıyı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Pencere", sembolAnlami: "Bkz.Cam. Bakış açısını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Pense", sembolAnlami: "Bkz.Kerpeten"),
            RuyaSembol(sembolResim: "", sembolisim: "Perde", sembolAnlami: "Görmek istememeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Peri", sembolAnlami: "Dileklerin kabul olmasını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Pınar", sembolAnlami: "Bilgi kaynağını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Pijama", sembolAnlami: "Bkz.Eşortman"),
            RuyaSembol(sembolResim: "", sembolisim: "Pil", sembolAnlami: "Günlük hayat enerjisini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Pilot", sembolAnlami: "Amacına hızla ulaşan ve diğer insanları da bu konuda yönlendirebilen bilge insanı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Pislik", sembolAnlami: "Dışkı görmek, tek seferlik gelecek parayı veya negatif şeyleri simgeler. Bazen de dışkı görmek, bırakmayı ve kurtulmayı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Pişmiş Balık", sembolAnlami: "Sezgileri almayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Piyango", sembolAnlami: "Talihinin açıldığını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Polis", sembolAnlami: "Güvenliği, güvenli alanı ve korunmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Portre", sembolAnlami: "Bkz.Resim"),
            RuyaSembol(sembolResim: "", sembolisim: "Projektör", sembolAnlami: "Dikkat edilmesi ve görülmesi gereken şeyler olduğunu simgeler. Kişinin dikkatini o yöne çeker."),
            RuyaSembol(sembolResim: "", sembolisim: "Protesto", sembolAnlami: "İtiraz edilmesi gereken şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Prova", sembolAnlami: "Kişinin bir şeyleri kendi hayatında denemesini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Psikolog", sembolAnlami: "Kişiyi ilgilendiren psikolojik durumları ve olayları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Pus", sembolAnlami: "Puslu hava görmek, gizli tehlikeleri simgeler. Kişinin dikkat etmesi gerektiğini ifade eder. Fakat pusu görmek, hali hazırda kişiyi bekleyen tehlikeler olduğunu temsil eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Pusula", sembolAnlami: "Yol gösterecek insanlara ihtiyaç duymayı simgeler. Rüyada pusula kimin elinde ise ona ait olan özelliklerle kişinin yol alabileceğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Put", sembolAnlami: "Yanlış veya maddiyata bağlı Rüya: inançları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Püskül", sembolAnlami: "Karışık görünen işleri simgeler. Püskülleri birbirine karışmış olarak görmek, işlerin karıştığını ifade eder."),
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Radar", sembolAnlami: "Tehlikeleri, daha yaklaşmadan algılamayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Radyo", sembolAnlami: "Duru işitiyi yani hissel yetileri simgeler. Uzaktaki bir şeylerden haberdar olmayı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Rahim", sembolAnlami: "Üretkenlik ve sanatı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Rakam", sembolAnlami: "Rüyada görülen rakamlar tamamen Rüya: kişiye özeldir."),
            RuyaSembol(sembolResim: "", sembolisim: "Rampa", sembolAnlami: "Rampa çıkmak, kişiyi zorlayan dönemi simgeler. Rampa inmek, kişinin rahatlayacağı dönemi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Reçete", sembolAnlami: "Kişinin şifalanması için neler yapması gerektiğini simgeler. Kişinin içinde bulunduğu durumdan kurtulması için gösterilen yöntemleri ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Renk", sembolAnlami: "Duygunun durumunu simgeler. Tüm renkleri bir arada görmek, duyguları ortaya çıkarmayı ifade eder. Rüyada görülen renkler, çakra renklerine göre yorumlanır. Örneğin; sarı çiçek, sarı objeler, mide ile ilgilidir. Bundan dolayı, renklere göre de hastalıkların sebebini bulabilirsiniz."),
            RuyaSembol(sembolResim: "", sembolisim: "Renkli Taşlar (Şifalı Taşlar)", sembolAnlami: "Enerjiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Resim", sembolAnlami: "Kişinin gelecekte yapabileceği ve yaşayabileceği anılarını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Ressam", sembolAnlami: "Hayal gücü geniş olan kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Rıhtım", sembolAnlami: "Bkz.Liman"),
            RuyaSembol(sembolResim: "", sembolisim: "Robot", sembolAnlami: "Başkaları tarafından yönetilen, duygusuz kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Roman", sembolAnlami: "Hayat hikayesini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Ruh", sembolAnlami: "Manevi alanı görmeyi simgeler. Ruhun bedenden çıkması, maddesel değerlerden sıyrılıp seyreden tarafa geçmeyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Rütbe", sembolAnlami: "İtibar görmeyi veya itibarın yükselmesini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Rüyada Rüya Görmek", sembolAnlami: "Kişinin manevi olarak derecesinin artmasını simgeler. Kişinin manevi olarak derinlik kazanmasını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Rüyada Rüya Tabir Etmek", sembolAnlami: "Rüyada görülen konu ile ilgili şifalanmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Rüyada Rüya Yorumcusu Görmek", sembolAnlami: "Kişinin rüyasının gördüğü gibi geçerli olduğunu, çok açık olduğunu simgeler. Bazen de kişinin kendi rüyasını yorumlayabileceğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Rüyada Zahmet Çekmek", sembolAnlami: "Doğru istikamet üzere olunursa işlerin kolaylaşacağını simgeler. Uyarı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Rüyada Zengin Birini Görmek", sembolAnlami: "Hem maddi hem de maddi olmayan kaynaklarda yaşanabilecek bolluğu simgeler. Rüyayı gören kişi, rüyada zengin olarak gördüğü kişinin özelliğini kendi hayatına uygularsa, o konuda bolluğa sahip olabileceğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Rüzgar", sembolAnlami: "Bazen yön vermeyi bazen de Rüya: savrulmayı simgeler."),
            
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "S Harfi", sembolAnlami: "Yılan gibi değerlendirilir. Gizemli alanları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Saat", sembolAnlami: "Zamanı, vakti simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sabah", sembolAnlami: "Yeni başlangıçları simgeler. Huzuru ve sevinci ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Saç", sembolAnlami: "Hisleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Saç Kıran", sembolAnlami: "Sadece bir konuda hissetmek istememeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sadaka", sembolAnlami: "yileşmek ve şifalanmak için bedel ödenmesi gerektiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Safra", sembolAnlami: "Sabırı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sağ", sembolAnlami: "Geleceği ve babayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sağır", sembolAnlami: "Duymak istemeyen veya duyamayan kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sağmak", sembolAnlami: "Fayda sağlamayı simgeler. Kişi rüyasında neyi sağdığını görüyorsa ondan faydalanacağını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Sahne", sembolAnlami: "Bkz.Tiyatro"),
            RuyaSembol(sembolResim: "", sembolisim: "Sahra", sembolAnlami: "Bkz.Çöl"),
            RuyaSembol(sembolResim: "", sembolisim: "Sahur", sembolAnlami: "Bir niyete hazırlanmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sakal", sembolAnlami: "Manevi hisleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sakat", sembolAnlami: "Bkz.Engelli"),
            RuyaSembol(sembolResim: "", sembolisim: "Saklanmak", sembolAnlami: "Kabullenmeyi, durumlardan ve olaylardan saklanmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Salıncak", sembolAnlami: "Gel git yaşamayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Salkım Söğüt Ağacı", sembolAnlami: "Merhametli, şefkatli, yumuşak huylu ve iyi insanı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Salyangoz", sembolAnlami: "Değişim ve dönüşümü simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Saman", sembolAnlami: "Zenginliği simgeler. Parasal değeri olan dünyalık birikimleri ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Sancı", sembolAnlami: "Batar ya da saplanır gibi duyumsanan, kesik kesik hissedilen ağrı, kişinin sancıyı hissettiği bölgesi ile ilgili dikkatli olması gerektiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sandalye", sembolAnlami: "Kişinin toplumdaki yerini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sandık", sembolAnlami: "Soydan gelen genetik mirası simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sapan", sembolAnlami: "İlişkilere zarar vermeyi simgeler. Taş atılan kuşun sembolik anlamı dikkate alınarak rüyanın yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Saray", sembolAnlami: "Sadece saray görmek, kişinin, çok zengin olma, ün, şöhret, saygınlık, ve itibar kazanma ihtimali olduğunu simgeler. Sarayın zindanında kendini görmek, kişi zihninin kalıplarından kurtulursa zengin olacağını ve itibar kazanacağını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Sarhoşluk", sembolAnlami: "Fark edememeyi, gaflet içerisinde  olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sarı", sembolAnlami: "Kişinin beslendiği veya beslemesi gereken şeyleri simgeler. Bazen babayı ve gücü bazen de hazmedilen veya hazmedilemeyen şeyleri ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Sarı", sembolAnlami: "Mide çakrasını simgeler. Hazmetmekle ilgili şeyleri ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Sarık", sembolAnlami: "Bkz.Kavuk"),
            RuyaSembol(sembolResim: "", sembolisim: "Sarılmak", sembolAnlami: "Sarılan şey ne ise, onunla bütünleşmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sarmaşık", sembolAnlami: "Kişinin bağlı veya bağımlı olduğu şeyleri simgeler. Bazen sarıp sarmaladığı insanları bazen de kişinin sarılma ihtiyacını ifade eder. Kişinin tutunma ve güvenme ihtiyacını temsil eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Sarmaşık Çiçekleri", sembolAnlami: "Kişiye ait olmayan duyguları simgeler. Mesela, kişi eşini sevmiyordur, ama onun kendisine karşı olan ilgisi hoşuna gidiyor ve ondan besleniyordur."),
            RuyaSembol(sembolResim: "", sembolisim: "Sarraf", sembolAnlami: "Kıymet bilmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Satranç", sembolAnlami: "İnsan ilişkilerindeki stratejileri simgeler"),
            RuyaSembol(sembolResim: "", sembolisim: "Savaş", sembolAnlami: "Bkz.Harp"),
            RuyaSembol(sembolResim: "", sembolisim: "Sayfa", sembolAnlami: "Kişinin hayatında yaptığı şeyleri simgeler. Boş bir sayfa görmek, kişinin yeni bir başlangıç yaptığını ve bazı şeyleri arkada bıraktığını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Sebil", sembolAnlami: "Sebilden su içmek, ilmi yüksek birinden ilim almayı simgeler. Sebilden su dağıtmak, kişinin kendisinin ilim dağıtmasını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Sebze ve Meyve", sembolAnlami: "Sebze ve meyve rüyada yendi ise, sebze ve meyvenin olduğu vakit, o şeyin gerçekleşeceğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Seccade", sembolAnlami: "Maneviyatta kökten gelen inançları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Seğirmek", sembolAnlami: "Kişinin görmek istediği ya da görmesi gereken bir insan olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sekreter", sembolAnlami: "Kişiye yardımcı olan insanları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sel", sembolAnlami: "Yanlış bilgilerle hayatta zorluk Rüya: yaşamayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sela", sembolAnlami: "Başkalarına maneviyatta destek olmak için yapılan çağrıyı simgeler. "),
            RuyaSembol(sembolResim: "", sembolisim: "Selvi Ağacı", sembolAnlami: "Gösterişli ve dikkat çekici olan kişiyiRüya: simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sema", sembolAnlami: "Bkz.Gökyüzü"),
            RuyaSembol(sembolResim: "", sembolisim: "Semer", sembolAnlami: "Bir kişiyi kontrol altına almayı ve ondan faydalanmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Serap", sembolAnlami: "Çölde serap görmek, kişinin yalnızlığını paylaşan insanların geçici olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Serçe", sembolAnlami: "lişkilerde hassaslığı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sevişmek", sembolAnlami: "Bkz.Cinsel İlişki"),
            RuyaSembol(sembolResim: "", sembolisim: "Sıçramak", sembolAnlami: "Rüyanın içinde sıçradığını görmek, aniden daha iyi bir duruma gelmeyi simgeler. Mesela aniden zengin olmak, aniden müdür olmak gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Sığınak", sembolAnlami: "Kişinin kendi ile baş başa kalmasını, güvenli alana çekilmesini simgeler. Bazen de geçmişe gitmeyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Sığır", sembolAnlami: "Bkz.Boğa"),
            RuyaSembol(sembolResim: "", sembolisim: "Sınav", sembolAnlami: "Kişinin yaşadığı döngüden dersini alması, dönüşmesi ve daha doğru yaşayabilmesi için hayat sınavı olacağını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sınıf", sembolAnlami: "Aynı şartlardaki ve aynı inanıştaki insanları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sırt", sembolAnlami: "Yükleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sidik", sembolAnlami: "Bkz.İdrar"),
            RuyaSembol(sembolResim: "", sembolisim: "Sigara İçmek", sembolAnlami: "Gereksiz yere zaman harcanan keyif alanını ve eğlenceyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sihir", sembolAnlami: "Diğer insanların hayatlarına müdahale eden ve onları etkileyen kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sihirbaz", sembolAnlami: "Göz boyayarak diğer insanları aldatan kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Silah", sembolAnlami: "Güç ve kudreti simgeler. Kurşun da gücü ve kudreti almayı ifade eder. Rüyada vurulmak kuvvetlenmektir. Silah ile vurmak kuvvet vermektir."),
            RuyaSembol(sembolResim: "", sembolisim: "Silahlı Çatışma", sembolAnlami: "Kişinin kendi içindeki vicdani çatışmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Silgi", sembolAnlami: "Yapılan işlerin yanlış olduğunu ve  silinip düzeltilmesi gerektiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sincap", sembolAnlami: "Kişinin çocukluk ve çocuksu hallerini simgeler. Yerinde duramayan, aşırı derecede hareketli ve aceleci davranış sergilemeyi ifade eder. Bu rüya kişinin daha hareketli olması gerektiğini anlatabilir. Fakat yatak odasında sincap görmek iyi değildir."),
            RuyaSembol(sembolResim: "", sembolisim: "Sinek", sembolAnlami: "Kişinin çok önemsemediği ama içten içe kendisini rahatsız eden şeyleri simgeler. Mide bulandıran şeyleri ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Sinema", sembolAnlami: "Bkz.Tiyatro"),
            RuyaSembol(sembolResim: "", sembolisim: "Sini", sembolAnlami: "Hiç beklenmedik bir zamanda bir şeyden yardım almayı simgeler. Bazen de umulmadık bir şeyi kazanca dönüştürmeyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Siper", sembolAnlami: "Kendini güvene almayı, korktuğun şeyden emin olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sis", sembolAnlami: "Belirsizliği ve ileriyi görememeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sivrisinek", sembolAnlami: "Kişinin enerjisini düşüren ufak tefek şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Siyah", sembolAnlami: "Ciddiyeti, karamsarlığı, yası ve gücü simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Siyah", sembolAnlami: "Gücü, hırsı, asaleti, ciddiyeti, kararlılığı ve bazen de olumsuzluğu simgeler. Siyah aldığını emer geri yansıtmaz. Bundan dolayı siyah almaya odaklıdır."),
            RuyaSembol(sembolResim: "", sembolisim: "Sofra", sembolAnlami: "Rızkı simgeler. Dünyalık nimeti ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Sokak", sembolAnlami: "Bkz.Cadde"),
            RuyaSembol(sembolResim: "", sembolisim: "Sol", sembolAnlami: "Geçmişi ve anneyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Solucan", sembolAnlami: "Bkz.Yılan"),
            RuyaSembol(sembolResim: "", sembolisim: "Sonbahar Mevsimi", sembolAnlami: "Umutsuzluğu ve hüznü simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sosyolog", sembolAnlami: "Tüm toplumu ilgilendiren psikolojik olayları ve oluşumları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Söğüt", sembolAnlami: "Anne ve anne atalarının genini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Söğüt Ağacı", sembolAnlami: "Yumuşak huylu ve iyi insanı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Söndürmek", sembolAnlami: "Ateş öfkeyi simgeler. Fakat ateş ihtiyaçları karşılamak için de kullanılır. Bundan dolayı ateşin nerede söndürüldüğü ve rüyanın genel durumu dikkate alınarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Sözleşme", sembolAnlami: "Hayatla yapılan sözleşmeleri simgeler. Mesela kişinin kendi içinden yaptığı kınamalar, yargılamalar ya da ben olsam asla bunu yapmazdım dediği şeyler vs. Bu rüyayı gören kişi hangi konuda büyük konuştuğuna bakması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Su", sembolAnlami: "Saf bilinç ve bilgiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Su Değirmeni", sembolAnlami: "Bilgiyi kazanca çevirmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sure", sembolAnlami: "Bkz.Ayet"),
            RuyaSembol(sembolResim: "", sembolisim: "Sussuz Kalmak", sembolAnlami: "Kişinin araştırıp öğrenmeye ihtiyacı olduğunu simgeler. Bazen de bir şeyin aslını araştırıp öğrenmesi gerektiğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Sülük", sembolAnlami: "Tutunmayı simgeler. Kötü gibi gözüken ama iyiye hizmet eden şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sümbül", sembolAnlami: "İlişkilerdeki bağlılığı ya da bağımlılığı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sümbül", sembolAnlami: "Bağımlı ilişkileri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sümük", sembolAnlami: "Sümüğün akması şifalanmayı simgeler. Kişinin yaşadığı ve bulunduğu ortam ile ilgili şifalanma yaşadığını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Süpürmek", sembolAnlami: "Süpürülen yerin sembolik değeri ne ise kişinin onu temizlediğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Sürgün Edilmek", sembolAnlami: "İnsanlar tarafından arka plana atılmayı, dışlanmayı, görünmez olmayı ve bir anda yalnızlığa düşmeyi simgeler"),
            RuyaSembol(sembolResim: "", sembolisim: "Sürme", sembolAnlami: "Bkz.Göz Kalemi"),
            RuyaSembol(sembolResim: "", sembolisim: "Süslenmek", sembolAnlami: "Kişinin kendini daha hoş bir hale getirdiğini simgeler. Fakat abartılı süslenmek, kişinin kendi gibi olmadığını hatta toplum içerisinde küçük düştünü ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Süt", sembolAnlami: "Bazen anneden geleni bazen de bağırsak ve bağışıklık sistemini simgeler. Ayrıca, kişinin neden beslendiğini de ifade eder. Sütün beyaz olması, helal kazancı ve kişinin helal yoldan beslendiğini; sütün lekeleli olması, kişinin kazancında hile olmasını temsil eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Sütun", sembolAnlami: "Bir şeyi ayakta tutan şeyleri simgeler. Sütunun nerede görüldüğüne bakılarak rüyanın yorumlanması gerekir. Eğer bir şey sütun olmadan ayakta duruyorsa bu daha güzeldir."),
            RuyaSembol(sembolResim: "", sembolisim: "Süzgeç", sembolAnlami: "Kişinin süzmesi ve dikkat etmesi gereken şeyler olabilir."),
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Şadırvan", sembolAnlami: "Her anlamda arınmak gerektiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Şafak", sembolAnlami: "Karanlıktan aydınlığa çıkmayı ve kişinin algılamaya, görmeye başladığını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Şair", sembolAnlami: "Bkz.Ozan"),
            RuyaSembol(sembolResim: "", sembolisim: "Şamar", sembolAnlami: "Kişiyi anlık kendine getiren ve fark etmesine yardımcı olan şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Şapka", sembolAnlami: "Kimlik tercihini simgeler. Kişinin neyin koruması altında olduğunu ya da neden korunduğunu ifade eder. Mesela kişi şapkayı rütbe için mi yoksa güneşten korunmak için mi takıyor. Bundan dolayı rüyada şapkayı kimin ve neden taktığına bakılarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Şarampol", sembolAnlami: "Yapılan yanlış şeylerden dolayı hedefe giden yoldan çıkmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Şarkı Söylemek", sembolAnlami: "Kişinin ruhu ile aynı frekansta titreşmesini simgeler. Fakat rahatsız edici bir şarkı söylemek, iyi değildir."),
            RuyaSembol(sembolResim: "", sembolisim: "Şehir", sembolAnlami: "Kişinin yaşadığı şehiri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Şehit", sembolAnlami: "Manevi mertebeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Şehzade", sembolAnlami: "Başarı potansiyeli olan kimseyi simgeler. Gelecekte başarılı olma olasılığı yüksek olan ve bu potansiyelini iyi değerlendirmesi gereken kişiyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Şeker", sembolAnlami: "Sevilme ihtiyacını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Şeker Hastası", sembolAnlami: "Diğer insanların kişiye bağımlı olmasını simgeler. Gerçekten de bu kişiler şeker hastası olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Şeker Kamışı", sembolAnlami: "Şeker kamışı ekmek ve toplamak, kişinin sevgiye ihtiyacı olmadığını ama kişinin toplum içinde sevilen sayılan bir insan olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Şelale", sembolAnlami: "Bkz.Çağlayan"),
            RuyaSembol(sembolResim: "", sembolisim: "Şelaleyi Seyretmek", sembolAnlami: "Şelaleyi seyretmek, kişiye coşku yaşatacak gelişmeleri simgeler. Kişinin coşkusunu ve işlerin iyiye gideceğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Şemsiye", sembolAnlami: "Korunmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Şerbet İçmek", sembolAnlami: "Öğrenmekten lezzet almayı simgeler. Kişinin hayattan keyif almasını sağlayan ve kendisine fayda veren şeyleri öğrenmesini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Şeyh", sembolAnlami: "Öncü olan kişiyi simgeler. Rüyada görülen şeyhin vizyonuna bakılarak kişinin neye tabi olduğu anlaşılır. Mesela rüya şeyhi görmek kişinin o yol üzere olduğunu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Şeytan", sembolAnlami: "Kötü ve negatif şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Şeytan", sembolAnlami: "Kişinin içinde bulunan, kötü düşünce, kötü niyet gibi öz varlığına ters düşen şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Şiddet", sembolAnlami: "Bkz.Dayak"),
            RuyaSembol(sembolResim: "", sembolisim: "Şifalı Sular (Termal Su - Kaynak Su)", sembolAnlami: "Faydalı bilgiler öğrenmeyi ve kişiye şifa olacak bilgiyi simgeler. Bu rüyayı gören kişi hasta ise şifalanır, sıkıntılı bir durum içerisinde ise bundan kurtulur."),
            RuyaSembol(sembolResim: "", sembolisim: "Şiir Okumak", sembolAnlami: "Bkz. Ozan"),
            RuyaSembol(sembolResim: "", sembolisim: "Şimşek", sembolAnlami: "Kollektifi etkileyecek zor ama geçici bir dönemin yaklaştığını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Şişirmek", sembolAnlami: "Kişinin büyüttüğü şeyleri simgeler. Rüyada kişinin şişirdiği şeye bakılarak, yorum yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Şişman", sembolAnlami: "Kilolu görmek, güçlü olmayı simgeler. Fakat yerinden hareket edemeyecek kadar kilolu olmak artık o gücün altında ezilmeyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Şişmek (Şiş)", sembolAnlami: "Büyümeyi simgeler. Fakat iyi mi yoksa kötü bir büyüme mi, rüyanın genel durumu göz önünde bulundurularak yorum yapılması gerekir. Ayrıca şişen şey ile ilgili sıkışıklık yaşandığını ve o konuyla ilgili bir patlama yaşanabileceğini de ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Şöför", sembolAnlami: "Hayatının kontrolü kimde onu simgeler. Şoför koltuğunda kim oturuyorsa kişinin hayatını o yönlendiriyor demektir."),
            RuyaSembol(sembolResim: "", sembolisim: "Şöhret", sembolAnlami: "Kişinin kendinde abarttığı şeyleri simgeler. Çünkü tanınır olmak saygınlık değildir. Şöhretli birini görmek, olan şeyi farklı görmeyi ve kendini şişirmeyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Şömine", sembolAnlami: "Bkz. Evin Sobası"),
            RuyaSembol(sembolResim: "", sembolisim: "Şurup", sembolAnlami: "Şifa almayı simgeler. Dikkat! İksir ile karıştıma."),
            RuyaSembol(sembolResim: "", sembolisim: "Şükür Etmek", sembolAnlami: "Şükür edilen şeyle ilgili nimetin artacağını simgeler."),
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Taahhüt", sembolAnlami: "Bkz.Sözleşme"),
            RuyaSembol(sembolResim: "", sembolisim: "Tabanca", sembolAnlami: "Bkz.Silah"),
            RuyaSembol(sembolResim: "", sembolisim: "Tabela", sembolAnlami: "Kişinin yönünü belirten ve yönlendirme ile ilgili yapılan uyarıyı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tablo", sembolAnlami: "Bkz.Resim"),
            RuyaSembol(sembolResim: "", sembolisim: "Taciz", sembolAnlami: "Kişinin alanına edilen müdahaleyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Taç", sembolAnlami: "Bir şeye en güzel ve en son halini vererek onu tartışmasız hale getirmeyi simgeler. Güç ve kuvvet sahibi olmayı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Taht", sembolAnlami: "Kişinin en değer verdiği yani kalbinde en önemli yere koyduğu şeyleri ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Tahta", sembolAnlami: "Genleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Takas Yapmak", sembolAnlami: "Değiş tokuş yapmayı simgeler. Rüyada kişinin neyin yerine neyi koyduğu önemlidir. Buna dikkat edilerek rüyanın yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Takı", sembolAnlami: "Bkz.Aksesuar"),
            RuyaSembol(sembolResim: "", sembolisim: "Takım Elbise", sembolAnlami: "Bkz.Ceket"),
            RuyaSembol(sembolResim: "", sembolisim: "Takip Etmek", sembolAnlami: "Örnek olmayı ya da örnek almayı simgeler. Takip gizlide olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Taklit Etmek", sembolAnlami: "Bir kimseye benzemeyi ya da bir şeyin benzerini yapmayı simgeler. Özgün hiçbir şey yoktur."),
            RuyaSembol(sembolResim: "", sembolisim: "Taksi", sembolAnlami: "Günlük hedefleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Takvim", sembolAnlami: "Önemli günleri simgeler. Eski bir takvim eski bir şeyi anlatıyor olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Tamir Etmek", sembolAnlami: "Kişinin düzeltmesi gereken bir şeyler olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tanımadığımız İnsanlar", sembolAnlami: "Rüyada görülen kişinin giyim, kuşam, hal ve hareketi ile rüyayı görene ne hissettirdiği dikkate alınarak rüyanın yorumlanması gerekir. Erkek her zaman gücü kadın ise sanat ve üretkenliği ifade eder. Ayrıca rüyada görülen kişinin hissedilen yaşı da önemlidir."),
            RuyaSembol(sembolResim: "", sembolisim: "Tarak", sembolAnlami: "Hisleri düzenlemeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tarihler", sembolAnlami: "Tarihler olduğu gibi çıkan rüyalardır. O tarihte yaşanılan, şahit olunan veya duyulan şeylere bakılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Tarla", sembolAnlami: "Kişinin yaptığı ettiği şeyleri simgeler. Tarlada ne olduğuna bakılarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Tartışmak", sembolAnlami: "Kişinin kendi içinde yaşadığı karşıt düşünceleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tasma", sembolAnlami: "İtaat etmeyi simgeler. Tasmanın kimin boynunda olduğuna bakılarak rüyanın yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Taş", sembolAnlami: "Zorluğu simgeler. Taş atmak ise suçlamayı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Taşınmak", sembolAnlami: "Değişimi simgeler. Taşınılan evin özellikleri dikkate alınarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Tatil (Tatil Yeri)", sembolAnlami: "Kişinin dinlenme ihtiyacı olduğunu, ara vermek ve nefes almak için duraklama ve dinlenme zamanını simgeler.Bazen de neyi dinlenmeye aldığını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Tatlı", sembolAnlami: "Kişinin yaptığı iyiliğe karşılık verilen ve kişiye lezzet veren ikramı Yorum: simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tatlı İkramı", sembolAnlami: "Bkz.Baklava"),
            RuyaSembol(sembolResim: "", sembolisim: "Tavşan", sembolAnlami: "Üremeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tavuk", sembolAnlami: "Her gün yeniden başlamayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tavuk", sembolAnlami: "Gözalıcı ve sanatsal hayal gücüne sahip olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tefsir Etmek", sembolAnlami: "Bir konuyu daha iyi anlamayı ve bu alanda idrakın genişlemesini simgeler. Rüyada tefsir edilen şeye bakılarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Tehdit Edilmek", sembolAnlami: "Kişinin korkusu ile yüzleşmesini simgeler. Şifalanma rüyasıdır."),
            RuyaSembol(sembolResim: "", sembolisim: "Tehlike", sembolAnlami: "Manevi konularda netleşmeyi simgeler. Mesela aldığı ücreti Allah'tan değil de kuldan bilen kişinin Allah'a yönelmesi için bu rüya gösteriliyor olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Teker", sembolAnlami: "Bkz.Araba"),
            RuyaSembol(sembolResim: "", sembolisim: "Tekme", sembolAnlami: "Harekete geçmen gerektiğini simgeler. Kötü zannedilen bir olayın aslında kişiyi harekete geçirmek için olduğunu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Tekne", sembolAnlami: "Muhafaza edilmeyi, güvende olmayı ve korunarak gitmeyi simgeler. Bazen gizlenen ilimleri de ifade eder. Fakat gemi kadar sağlam değildir."),
            RuyaSembol(sembolResim: "", sembolisim: "Telef Etmek", sembolAnlami: "Zayi etmeyi simgeler. Rüyada kişinin neyi telef ettiğine bakılarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Telefon", sembolAnlami: "Duru işitiyi yani hissel iletişimi simgeler. 3.gözü temsil eder. Kişi telefonda kiminle haberleşiyorsa onunla iletişim kuruyor demektir. Olumlu görüşme kişinin iletişime devam etmesini, kötü görüşme kişinin o iletişimi kapatması gerektiğini, ifade eder. Telefon kaybetmek, kişinin hislerine ihtiyacı olduğunu temsil eder. Telefon unutmak, kişinin hislerini orada bıraktığını ve artık hissedemediğini ifade eder. Telefon almak, kişinin hissetmeye çalıştığını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Teleskop", sembolAnlami: "İlim talep etmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Televizyon", sembolAnlami: "Duru görüyü yani hissel iletişimi Rüya: simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tellal", sembolAnlami: "Kişinin ısrarla duymak istemediği ama duyması gereken şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Telsiz", sembolAnlami: "Bilinçli yapılan telapatik iletişimi simgeler. İki kişinin arasında olan hissel iletişimi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Temel", sembolAnlami: "Alt yapıyı simgeler. Daha sonra işin sağlam olup olmayacağını belli eden süreci ifade eder. Rüyada ne görüldüyse temel ile onun alt yapısı anlatılıyor demektir."),
            RuyaSembol(sembolResim: "", sembolisim: "Temizlik Yapmak", sembolAnlami: "Bazı şeylerden arınmayı ve kurtulmayı simgeler. Genelde şifalanma rüyasıdır. Rüyada kişinin neyi temizlediğine bakılarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Tencere", sembolAnlami: "Kazancı nerede ve nasıl harcadığını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Teneke", sembolAnlami: "Sahte güç gösterisini simgeler.Öyle olmadığı halde dışarıya güçlü, kuvvetli görünen şeyleri ifade eder. Mesela kendini dışarıya güçlü göstermeye çalışan insan veya bir işletme gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Tepe", sembolAnlami: "Atalarımızda yükselmiş kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tepsi", sembolAnlami: "Hayatın kişiye sunduklarını simgeler. Tepsinin içinde görülen şeye göre rüyanın yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Ter", sembolAnlami: "Şifalanmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Terlemek", sembolAnlami: "Emeği simgeler. Alın teri, kazanç ile ile ilgili emeği ifade eder. Elin terlemesi, kişinin yaptığı emeği temsil eder. Tüm vücudun terlemesi, şifalanmayı simgeler. Fakat bunalmaktan kaynaklanan terleme, kişinin yanlış bir şey için emek verdiğini ve bundan vazgeçmesi gerektiğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Terapi", sembolAnlami: "Psikolojik olarak şifalanma isteğini simgeler. Doktordan terapi aldığını görmek, kişinin şifalanacağını ifade eder. Fakat yanlış birinden terapi almak, şifalanmak adına kişinin yanlış yöntemler kullandığını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Terazi", sembolAnlami: "Bkz.Kantar"),
            RuyaSembol(sembolResim: "", sembolisim: "Tercüman", sembolAnlami: "Kişiyi anlayan insanı veya kişinin diğer insanları anlamasını simgeler. Rüyada görülen kişiye göre yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Tereyağı", sembolAnlami: "Bkz.Yağ"),
            RuyaSembol(sembolResim: "", sembolisim: "Terfi", sembolAnlami: "Kişinin gördüğü şey ne ise onda bir kademe yükseleceğini ya da yükselme şansı olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Terlik", sembolAnlami: "Kişinin, evin içinde izlediği yolu simgeler. Örneğin ev halkı ile olan ilişkileri gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Termos", sembolAnlami: "Sabit tutmaya çalışmayı simgeler. Kişinin düşüncelerinin veya duygusunun değişmemesini, hep aynı kalmasını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Terzi", sembolAnlami: "Kendini yenilemeyi simgeler. Rüyada diktirilen kıyafetin şekline, rengine göre rüyanın yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Tesbih", sembolAnlami: "Allah'ı zikretmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Teşekkür Etmek", sembolAnlami: "Bkz.Şükür Etmek"),
            RuyaSembol(sembolResim: "", sembolisim: "Tezek", sembolAnlami: "Kişiye yarar sağlayacak maddesel şeyleri simgeler. Mal veya menfaat ya da bir gelir kapısına işaret eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Tezgah", sembolAnlami: "Kişinin günlük işlerini nasıl yürüttüğünü ve işlerin nasıl gittiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tırmalamak", sembolAnlami: "Mücadeleye etmeye çalışmayı simgeler. Kişinin bir şey için şansını denediğini,yapıp yapamayacağını kontrol ettiğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Tırmanmak", sembolAnlami: "Başarılı olmayı ve yükselmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tırnak", sembolAnlami: "Mücadele etmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tırtıl", sembolAnlami: "Kişinin yeni bir döneme başladığını simgeler. Devam ederse özgürleşeceğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Tilki", sembolAnlami: "Kurnazlığı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Timsah", sembolAnlami: "Sinsiliği simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Titremek", sembolAnlami: "Korkuyu simgeler. Titreyen bölgeye bakılarak rüyanın yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Tiyatro", sembolAnlami: "Hayat sahnesini simgeler. Oyuncular, kişinin hayatına girip çıkan insanları ifade eder. Geçmişteki şeyleri anlatır."),
            RuyaSembol(sembolResim: "", sembolisim: "Tohum", sembolAnlami: "Niyeti simgeler. Kişinin hangi niyette olduğunu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Tokalaşmak", sembolAnlami: "Anlaşma yapmayı ve kişinin yaşadıkları ile barışmasını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tokat", sembolAnlami: "Bkz.Şamar"),
            RuyaSembol(sembolResim: "", sembolisim: "Tomurcuk", sembolAnlami: "Bkz.Gonca"),
            RuyaSembol(sembolResim: "", sembolisim: "Topal", sembolAnlami: "Adım atamamayı ya da ilerleyememeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Toplamak", sembolAnlami: "Kişinin bir şeyleri topladığını simgeler. Rüyada kişinin neyi topladığı göz önünde bulundurularak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Toplanmak", sembolAnlami: "Kişinin değişim içinde olduğunu ve yeni bir şeylere başlayacağını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Toplantı", sembolAnlami: "İstişare etmeyi ve danışarak karar vermeyi simgeler. Konuyu her açıdan ele almayı ve düşünmeyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Toplu Taşıma Araçları", sembolAnlami: "Toplulukla beraber hareket etmeyi simgeler. Rüyada görülen duruma göre iyi veya kötü olduğuna karar verilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Toprak", sembolAnlami: "Bedeni yani insanı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tosbağa", sembolAnlami: "Bkz.Kaplumbağa"),
            RuyaSembol(sembolResim: "", sembolisim: "Toz", sembolAnlami: "Kişinin uzun zamandır kullanmadığı fakat kullanması gereken şeyi simgeler. Rüyada neyin tozlandığı dikkate alınarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Tören", sembolAnlami: "Bkz.Tören"), //(((((((((((///
            RuyaSembol(sembolResim: "", sembolisim: "Törpü", sembolAnlami: "Kişinin düzeltmesi gereken ufak tefek olumsuz hallari olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tövbe", sembolAnlami: "Tövbe etmeyi ya da edilmesi gerektiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Trans Birey", sembolAnlami: "Atalardan gelen dolanıklığı, karmayı, aktarımları, simgeler. Eril ya da dişil güce aşırı güvensizliği ifade eder. Kişinin gen hafızasında ya da anne ve babada aşırı bir güvensizlik olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Tren", sembolAnlami: "Zamanda yolculuğu simgeler. Eski tren, geçmişten gelen şeyleri; yeni ve hızlı modern tren de geleceği ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Tsunami", sembolAnlami: "Toplumda şok etkisi yaratacak bilgiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tufan", sembolAnlami: "Bkz.Fırtına"),
            RuyaSembol(sembolResim: "", sembolisim: "Tuğla", sembolAnlami: "Kişinin kendinde yaptığı değişimleri Rüya: ve bunun için yaptığı hazırlığı Yorum: simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Turuncu", sembolAnlami: "Hazmetmeyi veya edememeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tuvalet", sembolAnlami: "Bkz.Evin Tuvaleti"),
            RuyaSembol(sembolResim: "", sembolisim: "Tuvalet Aramak", sembolAnlami: "Bir şeyleri bırakmak istemeyi Rüya: simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tuvalet Bulamamak", sembolAnlami: "Bir şeyleri bırakmak isterken, bunun yöntemini bulamamayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tuvalet Kağıdı", sembolAnlami: "Kişinin daha da temizlemesi gereken şeyler olduğunu simgeler. Aslında kişinin bazı şeyleri bıraktığını ama ondan tam olarak arınamadığını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Tuz", sembolAnlami: "Şifayı ve zehiri simgeler. O yüzden her zaman şifa niyetiyle olumluya yorulması uygun olur."),
            RuyaSembol(sembolResim: "", sembolisim: "Tuzak", sembolAnlami: "Kişiyi bekleyen tehlikeler olduğunu simgeler. Kişinin dikkat etmesi gerektiğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Tüfek", sembolAnlami: "Bkz.Silah"),
            RuyaSembol(sembolResim: "", sembolisim: "Tükürmek", sembolAnlami: "Sözü ve şifayı simgeler. Ağızda görülen tükürük, sözü; Dışarı sert bir şekilde tükürmek, kötü sözü ve bedduayı ifade eder. Dua okuduktan sonra tükürmek, şifayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tül", sembolAnlami: "Bakış açısının açık olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Tünel", sembolAnlami: "Hayatın içindeki kısa yolları simgeler. Kişinin kötü sandığı olayların aslında kişiyi varmak istediği yere çok kısa yöntemlerle ulaştıracağını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Türbe", sembolAnlami: "Sorgulanması gereken şeyler olduğunu simgeler. Türbede kimin mezarı varsa o zatın özelliğine göre kişinin kendisinde sorgulaması gereken şeyler olduğunu ifade eder."),
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Ucuzluk", sembolAnlami: "Değersizleştirmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Uçak", sembolAnlami: "Yüksek frekans ile amaca hızla ve kolaylıkla gitmeyi simgeler. Mutlu, yüksek enerjiyle ve çabuk amacına gidebileceğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Uçmak", sembolAnlami: "Gökyüzüne doğru uçmak; frekansın yükselmesini ve manevi olarak kişinin derecesinin artmasını simgeler. Evlerin üzerinde uçmak, astral seyahati fakat bulutun altında uçmak, kollektif alanda astral seyahati ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Uçurtma", sembolAnlami: "Çocukluk hayallerini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Uçurum", sembolAnlami: "Kişiyi hayatının kötü bir yere gidebileceği konusunda uyaran rüyadır. Kişinin tedbir ve önlem alması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Ufalamak", sembolAnlami: "Bir şeyi ufaladığını görmek, verimli hale getirmeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Ufo", sembolAnlami: "Madde dışı her şey maneviyatı ifade eder. Ufo da maneviyata giden yöntemi simgeler. Mesela istihare etmek için uyumak gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Ufuk", sembolAnlami: "Yeni bir şeylerin gelmesini yani geleceği simgeler. Ufukta ne görülüyorsa rüyanın ona göre yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Uğraşmak", sembolAnlami: "Kişinin neyle uğraştığını simgeler. Ayrıca kişinin ruh halini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Uğur Böceği", sembolAnlami: "Şansı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Ulumak", sembolAnlami: "Köpeğin uluması, gelebilecek hastalıkları ve tehlikeleri simgeler. Kişinin dikkatli olmasını ve dua etmesi gerektiğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Umreye Gitmek", sembolAnlami: "Manevi yolculuğu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Un", sembolAnlami: "Evin bolluğunu ve bereketini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Usta", sembolAnlami: "Kişideki ustalığı simgeler. Ne ustası olduğuna göre rüyanın yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Utanmak", sembolAnlami: "Haya sahibi olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Uykulamak", sembolAnlami: "Her an gaflete düşebilme durumu olduğunu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Uyumak", sembolAnlami: "Gaflet içerisinde olmayı, yanılgıda olmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Uyuşukluk", sembolAnlami: "Kişinin hareket edemediği bir şeyler olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Uzay", sembolAnlami: "Enerji alemi, manevi alemi ve madde ötesi alemi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Uzay Gemisi", sembolAnlami: "Bkz.Ufo"),
            RuyaSembol(sembolResim: "", sembolisim: "Uzun Boylu Kişi", sembolAnlami: "Frekansın yüksek olmasını ve heybeti simgeler."),
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Ücret Ödemek", sembolAnlami: "Bedel ödemeyi simgeler.Bir şeyin karşılığını ödemeyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Üçgen Şekli", sembolAnlami: "Tek kaynaktan bütüne yayılmayı simgeler. Üst tarafı Yaratıcıyı, alt tarafı ise yaratılanları ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Üflemek", sembolAnlami: "Kendi maneviyatından vermeyi simgeler. Mesela dua okuyan kişinin üflemesi gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Ülke", sembolAnlami: "Kişi için neyi ifade ettiğine bakılarak rüyanın yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Ümit Kesmek", sembolAnlami: "Allah'ın izni ile ümit kesilen şeyin olacağını ve gerçekleşeceğini ifade Yorum: eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Ün", sembolAnlami: "Bkz.Şöhret"),
            RuyaSembol(sembolResim: "", sembolisim: "Üniforma", sembolAnlami: "Kişinin hangi hal üzere olduğunu simgeler. Üniformanın hangi meslek grubuna ait olduğuna bakılarak rüyanın yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Üniversite", sembolAnlami: "Üniversite yıllarında olan bir kişi için; hayat yolculuğunda üst seviyelere geldiğini ve şuan bunu öğrenme sürecinde olduğunu simgeler. Bazen de gerçekten o yıllarda yaşanmış olan bir olayı, travmayı ya da yanlış bir algıyı ifade eder. O zaman kişinin o anıları tekrar gözden geçirmesi gerekebilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Ünlü", sembolAnlami: "Bkz.Şöhret"),
            RuyaSembol(sembolResim: "", sembolisim: "Üreme Organları Görmek", sembolAnlami: "Erkek ise güç ve iktidarı, dişi ise üretkenliği ve sanatı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Üst Bacak", sembolAnlami: "Sabitliği simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Üşümek", sembolAnlami: "Sevgisiz kalmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Ütü", sembolAnlami: "Kişinin içinde bulunduğu hali düzeltmesi gerektiğini simgeler. Yaptığı şeyi hakkı ile yapması gerektiğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Ütü Yapmak", sembolAnlami: "Bkz.ütü"),
            RuyaSembol(sembolResim: "", sembolisim: "Üvey", sembolAnlami: "Dışlanmayı ve dışlamayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Üzülmek", sembolAnlami: "Şifalanmayı simgeler. Kişinin üzüldüğü şeyden kurtulacağını müjdeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Üzüm", sembolAnlami: "Kadın yumurtalığını ve kız çocuğu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Üzüm Bağı", sembolAnlami: "Bkz.Bağ"),
            RuyaSembol(sembolResim: "", sembolisim: "Üzüm Yaprakları", sembolAnlami: "Ahlaki değerleri simgeler."),
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Vaaz Dinlemek", sembolAnlami: "Kişinin ihtiyacı olan şeyleri simgeler. Bu rüyayı gören kişi bunu sıkıcı olarak anlatabilir. Çünkü onu yapmak istemediği için anlatılan ona sıkıcı gelebilir. Bundan dolayı buradaki sıkılma kötü bir şey değildir."),
            RuyaSembol(sembolResim: "", sembolisim: "Vade", sembolAnlami: "Bkz.Mühlet Vermek"),
            RuyaSembol(sembolResim: "", sembolisim: "Vadi", sembolAnlami: "Kişinin o an nasıl bir hayat yaşadığını simgeler. Kişinin önündeki kısa vadeli gelecekten bahseder."),
            RuyaSembol(sembolResim: "", sembolisim: "Vagon", sembolAnlami: "Tren vagonu görmek, kişinin geçmişten gelen yüklerini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Vaha", sembolAnlami: "Çölde vaha görmek, kişinin kendini yalnız hissettiği dönemde bir ışık görmesini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Vahiy", sembolAnlami: "Allah tarafından kişiye bildirilen emirleri simgeler. Kesinlikle kişinin dikkat etmesi gereken şeyleri ifade eder. Vahiy olarak inen şeye bakarak rüyanın yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Vahşi Hayvan", sembolAnlami: "Kişinin kendi içinde zapt edemediği hallerini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Vakıf", sembolAnlami: "Bkz.Dernek"),
            RuyaSembol(sembolResim: "", sembolisim: "Vali", sembolAnlami: "Kişinin yaşadığı şehirdeki saygınlığını simgeler. Yani o toplum içerisinde yaşayan insanların kişiye duyduğu saygıyı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Vampir", sembolAnlami: "Kişinin enerjisini düşüren insanları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Vasiyet", sembolAnlami: "Kişinin daha önce olmasını istediği şeyleri şimdi tekrar gözden geçirmesi gerektiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Vatan", sembolAnlami: "Kişinin etnik kimliğini, aidiyet duygusunu ya da kişiyi anlayan insanları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Vazgeçmek", sembolAnlami: "Bkz.Ümit Kesmek"),
            RuyaSembol(sembolResim: "", sembolisim: "Vazo", sembolAnlami: "Geçici duyguları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Veba", sembolAnlami: "Bazen bir hastalığın bazen de kötü bir durumun, düşüncenin veya alışkanlıkların hızlı bir şekilde insanlar arasında yayılmasını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Vedalaşmak", sembolAnlami: "Kişinin uzaklaştığı ya da uzaklaşacağı şeyleri simgeler. Kişinin ne ile vedalaştığına bakılarak rüyanın yorumlanması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Vekalet", sembolAnlami: "Vekalet almak, başkalarının adına davranmayı simgeler. Vekalet vermek, başkalarının senin adına davranmasını beklemeyi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Verem", sembolAnlami: "Kişinin yaşadığı yerden veya  bulunduğu ortamdaki insanlardan Yorum: kötü etkilendiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Veresiye", sembolAnlami: "Bedel ödemeden sahip olmaya çalışmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Vergi", sembolAnlami: "Kişi sahip olduğu malın ve mülkün belirli bir kısmını genellikle para olarak toplumun yararına vermesini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Veteriner", sembolAnlami: "Psikolojik rahatsızlıklardan, davranış bozukluklarından şifalanmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Vinç", sembolAnlami: "Güçlüğü simgeler. Zahmetli olan bir durum karşısında kişinin destek alması gerektiğini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Virane", sembolAnlami: "Kişiye atalarından kalan değerli özellikler olduğunu ve kişinin bu hazineyi keşfetmesi gerektiğini simgeler. Belki kişinin kötü olarak gördüğü şeyler ona bırakılan hazineler olabilir."),
            RuyaSembol(sembolResim: "", sembolisim: "Vitrin", sembolAnlami: "Kişinin diğer insanlara karşı sergilediği halini simgeler. Genellikle gösterişi ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Vize", sembolAnlami: "Kişinin izinli olduğu için Rüya: yapabileceği şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Vücuda Bir Şeyin Girmesi veya Saplanması", sembolAnlami: "Bedene metal bir şeyin saplanması kuvvet almayı, simgeler. Vücuda giren şey ne ise, kişinin ondan bir şey aldığını, ifade eder."),
            
            
            
            RuyaSembol(sembolResim: "", sembolisim: "Yabancı Birini Görmek", sembolAnlami: "Kişinin kendine ait olan fakat farkında olmadığı özelliğini simgeler. Rüyada görülen yabancının yaşı çok önemlidir. Rüyayı gören kişinin şuanki yaşından daha yaşlı ise, kişinin gelecekteki olası halini temsil eder. Fakat yabancı genç ise, kişinin o yaşta iken neler yaşadığına bakılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Yabancı Dil", sembolAnlami: "İdrakın genişlemesini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yabancı Ülke", sembolAnlami: "Kişinin kendini yabancı ve yalnız hissettiği ortamı simgeler. Kişiyi anlamayan insanların bulunduğu ortamı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Yabani Otlar", sembolAnlami: "Ayrılıkları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yağ", sembolAnlami: "Üste çıkmayı simgeler. Bazen kişinin ilk beslendiği şeyi bazen de kolaylaştırmayı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Yağ Satıcısı", sembolAnlami: "Ön plana çıkmak için yapılması gereken şeyleri yapmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yağcılık", sembolAnlami: "Yağ çekmek, ön plana çıkmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yağlandığını Görmek", sembolAnlami: "Tüm vücudu yağlamak, kişi o an ne ile meşgul ise onda ön plana çıkacağını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yağlanma Sorunları", sembolAnlami: "Genelde miras ve para ile ilgili konularda yaşanan sıkıntılar, kişilerde yağlanma sorunlarına sebep olur. Mirası çok almak ya da alamamak, parayı yemek ya da yememek gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Yağma", sembolAnlami: "Başkasının hakkına girmeyi, Rüya: haramı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yağmur", sembolAnlami: "Rahmet ve ilahi bilgiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yağmurda Islanmak", sembolAnlami: "Rahmet görmeyi ve yardım almayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yağmurluk", sembolAnlami: "Rahmet ve bereketten faydalanamamayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yaka", sembolAnlami: "Kişinin toplumda içerisindeki statüsünü simgeler"),
            RuyaSembol(sembolResim: "", sembolisim: "Yakışmak", sembolAnlami: "Kişinin kendisine yakışan şey ile uyum içerisinde olduğunu simgeler"),
            RuyaSembol(sembolResim: "", sembolisim: "Yalan Söylemek", sembolAnlami: "Samimiyetsizliği simgeler. Kişinin içi ile dışının aynı olmadığını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Yaldız", sembolAnlami: "içerisinde mübalağ olan her şeyi simgeler. Mesela süslü konuşmak, kendinde bir şeyi abartmak gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Yam Yam", sembolAnlami: "Dedikoducu ve iftiracı insanları simgeler. Gıybette bulunan ve bundan beslenen insanları ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Yama", sembolAnlami: "Kişinin kendi eksiklerini tamamlaması gerektiğini ya da tamamladığını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yanar Dağ", sembolAnlami: "Kişinin içindeki öfkeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yangın", sembolAnlami: "Genelde aile içerisinde ya da aile gibi görülen kişilerle yaşanan veya yaşanacak olan olumsuz durumları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yanık", sembolAnlami: "Kişinin kendi ailesindeki kişilerden ya da ailesi gibi gördüğü insanlardan incindiği durumu simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yankı", sembolAnlami: "Kişinin söylediği şeylerin aynen kendisine dönmesini simgeler. Rüyada duyulan şeye göre yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Yara", sembolAnlami: "Kişinin incinmişliklerini, aldığı zararları ve onu üzen şeyleri simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yarasa", sembolAnlami: "Negatif şeylerden beslenmeyi Rüya: simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yarış", sembolAnlami: "Kişinin yenmeye çalıştığı, yarıştığı her şeyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yarış Meydanı", sembolAnlami: "Hırslı olmayı ve kişinin herkes ile yarıştığını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yas", sembolAnlami: "Kişinin vedalaşamadığı durumları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yasak", sembolAnlami: "Rüyada yasaklara riayet etmek, kişinin kendi kalıplarından özgürleşemeyip hapis kalmasını simgeler. Yasaklara uymak iyi değildir."),
            RuyaSembol(sembolResim: "", sembolisim: "Yastık", sembolAnlami: "Bkz.Evin Yatak Odası"),
            RuyaSembol(sembolResim: "", sembolisim: "Yaşam Çiçeği", sembolAnlami: "Mitokondriyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yaşayan Birini Ölü Görmek", sembolAnlami: "O kişinin en önemli özelliği ne ise rüyayı gören kişide o özelliğin ölmesini ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Yaşlandığını veya Öldüğünü Görmek", sembolAnlami: "Olgun ve bilge insan olmayı simgeler. Çok hızlı tekamül etmeyi ve aydınlanmayı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Yatak", sembolAnlami: "Bkz.Evin Yatak Odası"),
            RuyaSembol(sembolResim: "", sembolisim: "Yatak Odası", sembolAnlami: "Bkz.Evin Yatak Odası"), ///////
            RuyaSembol(sembolResim: "", sembolisim: "Yatakhane", sembolAnlami: "Kişinin özel hayatını bilen ya da kişinin özel hayatını bildiği insanları simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yatalak", sembolAnlami: "Kişinin engellediği ve kullanamadığı yönünü simgeler. Bazen de depresyonda olduğunu ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Yay", sembolAnlami: "Kişinin hedefine ulaşabilmesi için ona yardımcı olan insanları simgeler. Mesela üniversite sınavına çalışan çocuğa ailesinin yardımcı olması gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Yaya Yürümek", sembolAnlami: "Kişinin günlük neler yaptığını, işlerini nasıl yürüttüğünü ve durumunu simgeler. Tek başına yürümek, bazen kararlı olmayı; biri ile yürümek, yürüdüğün kişiden güç almayı ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Yayla", sembolAnlami: "Ferahlığı ve genişliği simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yaz Mevsimi", sembolAnlami: "Kişinin rahat bir nefes aldığı, feraha erdiği dönemi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yazar", sembolAnlami: "Kişinin yaptığı ve kesinleştirdiği şeyleri ifade eder. Yazmak, kişinin ne yaptığından bahseder. Rüyada yazarın ne yazdığına bakılarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Yazı Yazılmış Kağıtlar", sembolAnlami: "Bkz.Sözleşme"),
            RuyaSembol(sembolResim: "", sembolisim: "Yelek", sembolAnlami: "Anne sevgisi ve şefkati ihtiyacını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yelek", sembolAnlami: "Kendini güvende hissetme ihtiyacını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yelken", sembolAnlami: "İşleri oluruna bırakmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yelpaze", sembolAnlami: "Kısa süreli rahatlamaları simgeler. Mesela kişinin ödemesi gereken borcunu bir ay erteletmesi gibi."),
            RuyaSembol(sembolResim: "", sembolisim: "Yemek Pişirmek", sembolAnlami: "Besleme ve beslenme ihtiyacını simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yemek Yeme", sembolAnlami: "Kişinin beslendiği şeyleri simgeler. Her beslenme farklı bir konuyu ifade edebilir. Kahvaltı yapmak, kişinin beslendiği ilk şeyi anlatır. Yemekhanede yemek yemek, toplum olarak kişilerin neden beslendiğini anlatır."),
            RuyaSembol(sembolResim: "", sembolisim: "Yemin Etmek", sembolAnlami: "Kişinin kesin kabul ettiği ve konuştuğu şeylere bakması gerektiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yengeç", sembolAnlami: "Sert görünen duygusal kişiyi simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yeni Doğmuş Bebek", sembolAnlami: "Bkz.Bebek"),
            RuyaSembol(sembolResim: "", sembolisim: "Yer Altı Şehirleri", sembolAnlami: "Genel insanlığın bilinçaltı kayıtlarını simgeler. Yani eski kadim uygarlıklara ait bilinçaltı kayıtlarını ifade eder."),
            RuyaSembol(sembolResim: "", sembolisim: "Yer Sarsılması", sembolAnlami: "Bütün dengelerin değişeceğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yere Batmak", sembolAnlami: "Bir süre itibar kaybetmeyi ya da hastalanmayı simgeler. Fakat bundan sonra güzel gelişmeler olacağını ifade eder. Bu dönem bir şeyi ortaya çıkarmadan önceki kapanma dönemi gibidir. Dikkat! Bataklık ile karıştırma. (Bkz.Bataklık)"),
            RuyaSembol(sembolResim: "", sembolisim: "Yeşil", sembolAnlami: "Tamamen bütün olmayı, birden bütünlüğe geçişi, şifayı, maneviyatı ve niyeti simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yeşillik", sembolAnlami: "Kalp enerjisini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yetim", sembolAnlami: "Yetim çocuk görmek, kişinin kendisini o yaşta iken yetim gibi hissettiğini simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yığmak", sembolAnlami: "Kıtlık psikolojisine giren insanı Rüya: simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yıkamak", sembolAnlami: "Direk arındırmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yıkanmak", sembolAnlami: "Arınmayı simgeler."),
            RuyaSembol(sembolResim: "", sembolisim: "Yıkmak", sembolAnlami: "Bir şeyi dağıtmayı ve bozmayı simgeler. Rüyada kişinin neyi yıktığına bakılarak yorum yapılması gerekir."),
            RuyaSembol(sembolResim: "", sembolisim: "Yılan", sembolAnlami: "Bir yaşam biçiminden başka bir yaşam biçimine geçmeyi simgeler. Bir halden bir hale hızlı ve kolay geçiş yapmayı ifade eder. Kişinin hayatında olacak değişiklikleri temsil eder. Rüyada görülen yılanın güzel veya çirkin olmasına göre yorum yapılır."),
